INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 1, '  Hatseto mawotich oochu Jesus Christ, Tikeaootli ma chue; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 2, 'Takeh nichatinkles akehe koonachatya kehe, Oosooasi sakewotihche nachatyea atghuni oochu naaootle. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 3, '  Hligi otyesta tike kemweh toowe ooli, Atghuni oochu ahasoonesun, aghahati tsiwoeseh kwetooyakehe.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 4, 'John tane tukeghingklit kemweh, hatse tane tatilon tunaghakeooskliti ahtilon otlwechi keochehlalon kehe aghametseli oneochetolel asilon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 5, 'Kahchu yinkhadeshalon tike okehe otsi Judaea, kahchu aghatane yateh otsi Jerusalem, kuihe sahke Jordan aghanetye tukukeghinklilon, koometselihi kooatuoochatihi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 6, 'John ghatai manatsunne ghigheze gha eghayulon natun atyetlalon atazi syeh kahchu atazi syeh ihe nanihklulon: oohchu yaskesi yu achalinoo yu ayilai yetsetlon; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 7, 'Oochu toowe ooli yehtilon, yetsi ootelon, Hligi sooniya sataihchi anati, nakyeklule aghoo atu enasoo machi chunoostyeli mamakeoosut. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 8, 'Suni la tu ihe naghakyeihklit: ahwole atai tu ihe naghakyeihlili Atsinde Oochu ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 9, 'Occhu gheise wazeluh ayi dzine, Jesus otsidesha Ion Nazareth Galilee otsi, John tuyakeghinklilon Jesus Jordan otsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 10, 'Kwete tu tsi tghatyeza tsiwohzon, wailon yake kwa matahatsataghiolon, yakeotine yetsi natezalon oietli etye: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 11, 'Oochu otech yake otsi atitsuklon, toowela ooli oti ihe, Nila otaihchi nwasti Sachue. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 12, 'Kwete atsinde achu tike tsi yatehalon kemwehchi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 13, 'Koochi kemwehchi atu tane nuklechi tioketi dzineke kooali, yakaotehun Metseli aghaghatai; kahchu ghatai metseli ihkyateslon; kahchu oochu woei oochu yetsinatilon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 14, 'Kootoo John kwechaghinhtyilon tane kwechaghinhtyinti, Jesus yuhchidesha Galilee, koohootyeh otech oochu Nagha Tgha makaoonadzutti otsi, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 15, 'Kahchu toowela ooli, Tyeneti Nagha Tgha kyeyi: naghametselihi kyechahli, oochu otech oochu aha kootahti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 16, 'Ihtyezon tu chok Galilee tghamweh klontyesha, yailon Simon yu Andrew yu mekye yu tyemil tayesklu tu chok: atai tane taesklu tane eli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 17, 'Oochu Jesus toowela ooli yehti, Sakyetahtyel, kooh hanahooslihi oohchu hluge kehchi enahooslihi tane niyutooleli chon otsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 18, 'Kwete taghatyemile echaghanelelon kikyehtyeshalon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 19, 'Oohchu oontsutli tontyo tyesha, yaih James Zebedee machue, kahchu John mekye, atilon tachin ela ehkye atyi tyemil keyatinklulon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 20, 'Kwete tyechi yehtilon: kwa taghata echughanelilon tachin ela ehkye atyi Zebedee oochu keotihche yu, oohchu kikyetyesklit. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 21, 'Oohchu kochi ghatyestyetl Capernaum; kahchu kwete taneghaotatyech kwa kwiya menejitti dzineneh tane chehotyeh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 22, 'Oneghanintyellon yaotihche: kooatinti yaotatiheh otech oochu tatihi natsuti kehchi ayihoo mawoochuli, atu adeskles tane kehchi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 23, 'Oohchu iehti kweh atiih hligi teze ta kwa taneghaotatyech yaghati metseli ayiih; kahchu ootyestalon, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 24, 'Toowe ooli, Atu aghaititaniah; atu ooli nagha assitli iyo aoohti, nuni Jesus Nazareth otsi? Yuhchitiyala aghayaonila? Atanasti nelesi Nagha Tgha Maatsinde Oochu ooih. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 25, 'Jesus toowela ooli yehti, yachioote, Atu oonatih yehti, setseghatiyah yetsun tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 26, 'Kootoo aghaghatai tsunale too yayaghinchil, oohtye ootyestalo, yetsi hadesha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 27, 'Aghanetye ooghatesta, aghanetye chu koohtaghoati, tiyeohtye, yetike aloontye? ye tane tsi oochatihi koonte? Aha kootesti otech oochu gha saghatai mayis atu natset. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 28, 'Koohchu oonthe atyeh meghoyuh yito kwa Galilee. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 29, 'Ayite otsi, ghaghatestyetlon taneghaotatyechi kwa otsi, kweghaghintyetl Simon yu Andrew yu kwa, James chu John chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 30, 'Simon tsiyue ma tyelasatyi teskoone ayila, oohchu koohoohati. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 31, 'Yechidesha yila inchut, kahchu tahyatinti; kwete ayi teskoone ayila yecheli, ayi oota yakeotihch. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 32, 'Hatse kahkachi, naghioo, kiya nanila yatitine, yaghi chu mazichi yaghatai metselihi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 33, 'Kahchu atghe ehlaititi tane natihti tyechiklaghatati tusklahti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 34, 'Kahchu atghazi tatihi akooyilalon ayeeah natlone yehtanintyelon, kooyaghatai metselihi natlon oonteslalon; kahchu atu ketselihoo wahti iyao-ohti, achi atayatilon ayiwooh ayehti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 35, 'Kahchu hatlindo, setsehto tsitike satalon, hadesha, kahchu koondeshalon aghasuchalechi, kahchu iehti yachutatyeheh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 36, 'Kahchu Simon yehkyatehchi kikyehtestyetllon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 37, 'Kikihtitsi, toowela ooli kiyehtilon, Atghe tane ninkhaghanatgha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 38, 'Towehchu yehti, Tane natehtsi otsidooshai kooche oohoostihi oochu, kootatooshigha lasasta aoontye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 39, 'Kahchu tane tsiwoghintalon taneghaotatyech kwa kwe Galilee, kahchu atsinde metseli ghayatehalon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 40, 'Kahchu machitatestyel tane tsusachi yaghoone yatsi nioonunisit, kahchu machi nachustachaklih, kahchu toowela ooli yehtilon Kooh koodinti ate oochu asaghoonlehassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 41, 'Kahchu Jesus, atyetastihtoo madzye tatilon nati gha tiesunni ihe, yetsi tahtatitichlon, kahchu yakatehtich lon, kahchu toowela ooli yehtilon, Kooh koosti; kwakoola oochu anatyeh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 42, 'Tsiwohzon otatyech otye, susuchi yetselilon, kahchu oochu oohtyelon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 43, 'Kahchu yatatilon tsiwohzon itintiah, kahchu oochu tyehalon; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 44, 'Kahchu toowela ooli yehtilon, Atu kahchu ooli ataoonti niwotine: kahchu achutiya, nazi yueh taneghaotatyech metihi, kahchu khaniah naoochu oohtyi ihe yaghi Moses za kyehchi, ata kiyutihi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 1, 45, 'Kahchu hadesha, oohtye awonetye khootawootyelon, kahchu tike okehe khootawotyelon, kwa hlilon Jesus atu tanetghakweya tyetachatlihi kwa iyu meheaoontye, ahwole kemwehchi tike alilon, kahchu kiyinkhatestyetllon ewonetyetsi otsi.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 1, 'Kahchu kwiyalon Capernaum tahke dzine oolitatatich wazilate; kahchu kooachatilon ayiti nito kwa oota ko-ochati ihe mewoyu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 2, 'Kwete natlone tyechi ghlaghatilon, kwa hlilon taghadesmanlon atulitah ookuzze ooli ghintlon kye, kwa hlilon tusla aghoo ooghata taghadesman ghintlon kye; kahchu sa yatatilon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 3, 'Kahchu kiyinkhatestyetl yatilonooh yatitihi ihe, tyentane kooyahtyel. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 4, 'Kahchu atu ugha otsighatatyel iyua aoontye ootaneghutl kye, nighatilalon anetiyi ootaneghutl kye alinti; kootoo ghaghatagheoo yatilone, kitaghintsut takeustyi tyela satyechti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 5, 'Kootoo Jesus wai aha oochati, toowela ooli yehtilon ayi yatilone, Sechue, nametselihi naoonchatuleli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 6, 'Ahwole tahkine ayiti tyechii adesklesne, kahchu koodzye otsi indighateshalon, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 7, 'Yeoogha ti teze atu oochu ateotye? mea metsehhi ka oontoolelassi kootahtye Nagha Tgha zon? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 8, 'Kwete Jesus ataotio yaghatei intidesakehe, toowela ooli yehtilon, Yehoo oohtye naghadzye ihe intidaa aoontye? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 9, 'Tyeyi meotena achatooti kehe yatilone, Nametselihi naoonchatoolel; koolehe, Tsitike sinta, nustyi neodiah? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 10, 'Atawahtihi iyu aoontye hligi teze Machue natsutti ayehi chode tike kakametselihi naghaoontooleli, (toowela ooli yehtilon yatilone,) ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 11, 'Toowela nesiih, Niiya, nustye nioodiah, nakwa otsidiya. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 12, 'Kwa kwete niiya, ustyi nioodioo, kahchu hadesha aitye yai; kwa hlilon atghe yaooli, kiyaooli Nagha Tgha, toowela ghatyeh, Atu haoontyedi oohwetyi tahooli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 13, 'Kahchu tu chok meootyesha; atghe aghanetye machichatyesha, kwa yaotatich. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 14, 'Intyizon ghayalu, yailon Levi Alphaeus ma chue sata sooniya mechetilichti, toowela ooli yehtilon, Sakyetiya. Kahchu niiya yekehtesha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 15, 'Hesai wazeluh Jesus yakwa kwesata atsitsoo, natlone tanechowhoine chu metseline chu Jesus yakahtehtsi yaotatichne chu: oohchu ghintlone, kooketestyetl chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 16, 'Kootoo hatseto adesklesne chu Phariseene chu kiyaichi inka aghatsitsoo tanechowhoine chu metseline chu, toowela ooli yehtilon yaotatichne, Yehoo yakaatsits aoontye yakah chu tuaton tane chowhoine chu metseline chu? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 17, 'Kootoo Jesus ootitsahoo, toowela ooli yehti, Yaghine oochu oontyene atu kiyinkhasootati yutane, yatitihizon: atu yuhchideya tyechi kooyusine tyeswe yaghitane, ahwole ayi atu tyeswe yaghitane chodeh kyetsahanohoolehe koometselihi ooghatihuali. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 18, 'Kahchu yaotatichne John chu Phariseene chu ooneaghatatihya toonkye: kahchu yuhchihatestyetl toowela ooli, yehoogha yaotatichne John chu Phariseene chu ooneatatehya aoontye, ahwole nuni maghotintichne atu ooneatatehya? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 19, 'Kahchu Jesus toowela ooli yehti, Maskyege la kwa nichiyehi kooyehkyatechi ooneatatulela la? kooyehkyatechton atu ooneatatehya iyu aoontye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 20, 'Ahwole kwa kwete khoonahwozetasi, kootoo mka tuchainklitne kwiya kwa oochayihate, kahchu ayi dzine ooneatatuyelassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 21, 'Atu chu ooli koonde ale ooli tsatse ihe kyechatoohkatassi, yaikoole koonde ihe kechaghinghati kwa hlilon hleooyu awotiassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 22, 'Kahchu atuline tata ahklitassi chiche tu koonde satsoone tontyeto otsi: atu chu chiche tu ooli tsatse tataoohklit ootookyezasi, kahchu natesklitchiche tu, kahchu mataootsayih oontookyezasi: ahwole chiche tu koonde ooli ta koonde chuhklitassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 23, 'Kahchu otles tghah niya achuniyehti Menejitti Dzine; kahchu yaotichne makye ghatehlu atghe inchaghakinesla otles. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 24, 'Kahchu Phariseene toowehchu vehti, Nye, yehoo koohghaghati aoontye Menejitti Dzine atu tu dzine kooh ghatsati iyu aoontye? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 25, 'Kahchu toowela ooli yehti, Atu makyeh ootahtyech tah oolila David aoontli kootoo intaklinto kahchu tapatoo, atane chu ayi vehkyatiche chu? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 26, 'Kwiye sikooh Nagha Tgha kwa, intyizon Abiathar taneghaotatyechi metihi chok acha, kahchu kiyatsetslon otles oochu atuline yetsitslon gha yai zon taneghaotatyech, kahchu yayigholon ayi yehkyatiche. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 27, 'Kahchu toowela ooli yehti, Menejitti Dzine achilalon tane gha, kahchu atu chu tane Menejitti Dzine gha: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 2, 28, 'Ayigho teze Chue ghakaoodzut Menejitti Dzine.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 1, 'Kahchu tyetachatlihi kwa kwiya: ayiti teze natyelon mila taneskyelon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 2, 'Kahchu kiyunailon, ooka ooli asityeh kha Menejitti Dzine nai; kitalih iyu aoontye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 3, 'Kahchu toowela ooli yehti ayi teze mila taneskye, Hatelon atichi nazutooh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 4, 'Tooweh chu yehti, Oochu la oochu keoochuahch Menejitti Dzine, ketseliooh keoochuahch? tane ghaghatai gha kasoochatooti gha koole? Ahwole atu ooghati. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 5, 'Kahchu anetye klokanatghalon madzyehatsutooh, kyeoocheklah ihe tane dzye natsutti, tooweh chu yehti teze, Tahtatinti. Ooh kahchu tahtatintieh: oohchu mila natsaghinhtalon achune kehchi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 6, 'Kahchu Phariseene achughatestyelon, kwete hla nighohanintalon yai chu Herodianuk, tihakehe soo ookitoohtelu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 7, 'Ahwole Jesus achutyezha yaghotine chu tu chok tsi: Kahchu tane natlone Galilee otsi yu Judaea otsi yu yekehtestyetl. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 8, 'Kahchu Jerusalem otsi, kahchu Idumaea otsi, kahchu o-one otehchi otsi Jordan, kahchu aghatane ahthaze Tyre yu Sidon yu, ghintlon ke, ooghatitsuk chi ayi oochu keoahchi, kiyinkhadesha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 9, 'Kahchu yaotatichne tatilon, ela ckok natsutli ootagha iiti wothoogha kooghohtyi tane natlon ke kha ati makechichiticha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 10, 'Atane natlone yaghihti ihe; kwa hlilon yinkghanotyesuts yakatutihikha, anetye ayi tatihi akooyahine. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 11, 'Tane yaghatai mindicheli kahchu kiyainchi ate, kyechinachustaklih, kahchu ghatyezul toowe la ooli kiyehti ihe. Nuni Nagha Tgha Chue nelaoontye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 12, 'Kooh oochu atu soohchiwoti atu atachutihikha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 13, 'Kahchu khis ehkyeghiyalon, kahchu ayizon ayuti tyechi yehti: yachidesha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 14, 'Kahchu keneti onketi matgha kliniyanila, yekyeootichigha, kahchu achutehalon udzih oohootigha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 15, 'Kahchu ayulhi gha natsutti, kahchu atsinde metselihi hayatuhi gha: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 16, 'Kahchu Simon yindizi yakechioosun Peterlon; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 17, 'Kahchu James Zebedee machue, kahchu John, James mekye; kahchu nindizi yakechioosun Boanerges, ayi nahthunni uskyege chatyeh: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 18, 'Kahchu Andrew, kahchu Philip, kahchu Bartholomew, kahchu Matthew, kahchu Thomas, kahchu James Alphaeus machue, kahchu Thaddaeus, kahchu Simon ayi Canaanite, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 19, 'Kahchu Judas Iscariot, mazi atahootalon: kahchu nito kwa kwighaghintyetl. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 20, 'Kahchu natlone natsughanestlalon, ehtye kwa hlilon atu otles atsitslon natlonke. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 21, 'Kootoo meootinoo ootitsukoo, achughatestyetl kiyuhchutigha: aghatune kooghatyeh, Tinditaodesooissi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 22, 'Kahchu adesklesne yuhchighatestyetl Jerusalem otsi ghati, Ayehi Beelzebub, kahchu yaghatai metselihi iiti otsi hayateha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 23, 'Kahchu koohchu yinkhawoti, kahchu too we yehti, tyecha otsi aghaghatai metselihi hatsatoohtyel oontye ayi aghaghatai metselihi? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 24, 'Kahchu hlahti tane natehti intsake yawoinklit ate, ayiti tike ii oowotoehassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 25, 'Kahchu ayi nito kwa yaooghinkliti ate, ayi nito kwa oowotoehassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 26, 'Kahchu aghaghatai metselihi ataniiya ate, kahchu tezi yanile ate, atu oowotoehassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 27, 'Atuline kweyali iyua aoontye teze natsutti kwa, yenatunne yatatulelu, hatse tahyaghesklu teze natsutti; atezon ya kwa yaghonile iyu aoontye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 28, 'Kwa hli anaghaisilon, Atghe metselihi kooya oochatoolelassi tane uskyege, kahchu soocha oochatihi: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 29, 'Ahwole ayi ketselioo atii Menejitti Oochu atu ihlaotateoo ayehi kha, ahwole seghaai ayehi nioonizutti oonchatalihi: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 30, 'Ayighoo ayehti, Ayehi aghaghatai metselihi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 31, 'Kahchu mekye chu ma chu iiti otsighatestyetl, kahchu tsehtsi nazutooh, kilati, kiyinkhaooti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 32, 'Kahchu tane natlone yaka tghanatihtsi, tooweh chu kiyehti, Nea, noo chu nehtghizinne chu tsehtsi naghatehya ninkhaghanata. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 33, 'Kahchu ateyatetla, toowehchu yehti, Mea anne eli, setghezinne koole? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 34, 'Kahchu khlonkanatgha ayi yaka khlontyetsi, kahchu toowela yehti, Ahi anne chu sehtghezoon chu! ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 3, 35, 'Atunne zon kooh ghawoteassi ayi Nagha Tgha indi, ayi akye chu, ustye chu, unne chu.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 1, 'Kahchu tyigha tane ootatech tu chok tghamweh: kahchu natlone yinkhadesha, kahchu tachin ela ehkyiya, kahchu tu chok tih ali; kahchu atghe tane natlone tike wohzon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 2, 'Kahchu yachioteh ooli natlon yughotyeh, kahchu toowe ehti otsiootihi, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 3, 'Oochu atahtsuk; Oochu hadesha otles alihi tane anihyihi niyilihi gha: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 4, 'Kahchu intyizon achunihyehti, tahkine yainkhyi tinkuzze, kahchu chua etye yaghatehtyetllon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 5, 'Kahchu tahke nooghinklit tsyetgha, atu oonchadi tike ooliite; kahchu kwete ghanaghiyu, atu tike tatghoe: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 6, 'Ahwole chelon sa niniya, maziche ninihklitlon; aha oona maghaye toontooeyi, ayi ihe taihtsutii. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 7, 'Kahchu tahke nooghinklit ghoos chine chok tgha, kahchu ghoos chine chok ghanaghiyu, kahchu klighatanityetUon, kahchu atuli machiche oolilon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 8, 'Kahchu achu nooghinklitlon tike oochu ti, kahchu machiche ooghilyelon ghanaghiyu yu kahchu tainyezho; kahchu yahlonihyu tahke taoketyi tahke chu edzetaiti ketyi, tahke chu keoneti ketyi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 9, 'Koohchu yehti, Yaghi matsaghe ooli, inkai ootootsuke yehti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 10, 'Kootoo chlatyo ayi yehkatyelichi yaghi chu keneti onketi matgha tawotya yehti kawotzutne gha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 11, 'Kalichu toewela ooli yehti, Naghunni aghaoochuneoh aoontye atawohtihiglia tyewotye hai koosti Nagha Tgha kyeyi: ahwole ayine tsehtsi natihne, atghe ooli keowaahch yehe achatih: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 12, 'Wai oochui, kahchu atu hlyenahotihi gha; kahchu ooghatitsukooh ooghatootsukassi lon, kahchu atu klaghatootsukassilon; koohchu oolita ghooghanetyela, koometselihi kooya oone oochatulel akhe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 13, 'Kahchu toowela ooli yehti, Tiyeghakehe atawahtiha ooli kehe yaghaghahtai kehe? koohchu yeghateh atawahtiha atghe otech? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 14, 'Oonehyene oonehyoh sa. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 15, 'Kahchu aghatane tinkuzze tatihne sa chunihyehti; ahwole kootoo ooghatitsukassi kooh ghaghatai metseli kwoto otsidesha, kahchu yazake yuhniyatiooh yadzye ta otsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 16, 'Kahchu aghatane chunihye ine tsye tgha; kootoo sa ooghatitsuk, kwete neooatiooh soochanetye; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 17, 'Kahchu atu ghai ighutaklilon aghatane hahte, kwa tiootsi zon ghaghatalon, ootlwe kootoo sookhaootaya kootoo hlachatatane niwoya sa tachi kwete chahte intighatesah. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 18, 'Kahchu aghatane ayi yachunihyene ghoos chok chine tgha; ayi sa ooghatitsuh, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 19, 'Kooh tidi tike indi, kahchu mihe atsunnetahe yu mihe tatintlon yu, kahchu machachintye achu ooli kwenachaghila otcho ooli sa, kahchu atu machiche ooli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 20, 'Kahchu ayi mehoochunihyehe tike oochute; ayi ootitsukne sa, kahchu niooatioone, kahchu machiche ooli, tahke taoketyi enetyi, tahke chu edzetaitiketyi, tahke chu keonetiketyi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 21, 'Kahchu toowela yehti, Nachila takooche nichualli ghotwetghulle yue take ustyi koole? koohchu atu nichiooite takoochechine? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 22, 'Agha atuli nachunehi atu mewotuti; kahchu atuli tanetcha maghuchata iyu aoontye, ahwole atachuteassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 23, 'Koole matsaghe oolyetane inkai ootootsukassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 24, 'Kahchu toowela ooli yehti, Tyeke ayi ootahtsukki: ayi ihe tikeghaklyeli, ayieh nagha tsi tiketsalelassi: kahchu naghai ootaghahtsukki, ootehchi nahachuallassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 25, 'Yaghi ayehi, machuallassi: kahchu yaghi atu ayehi, mehwayachutallassi koole ayi ayehi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 26, 'Kahchu toowela ooli yehti, Koohia ootye oontye Nagha Tgha kyeyi, hletye teze oochunehyehti oodihyitl keoontye; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 27, 'Kahchu satyi, kahchu niiya hatleke chu dzine chu, kahchu achunehyehti ghanaghihu, atu ataoti noontye sikooh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 28, 'Ghoo yaghi tike atai hahte otsi ghanaghihu; hatse kloke eli, kahchu hachaghinaghiyu, kahchu otlweh ootles. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 29, 'Kahchu yaghi chiche ghanaghihuta, kwete atataz, khoo chotazze dzine eli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 30, 'Towehchu yehtilon, Tyechi otsi gha Nagha Tgha kehchi niwowotal aoontye manatake? koole hletyi indi nighaootal aoontye? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 31, 'Hleoontye oochuniliyehti ehlatye yutanikluchi machiche, kwa nichalesta oonahyehe tike, eyi zon natsutli anetye oochu ihyehe tike tih: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 32, 'Kwa aochelesta, oochu nichulesta ayi zon otehchi yaincha anetye nichulihchassi, kahchu matatse natlon; kahchu ayiti chua yayue sacha iyue tehtsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 33, 'Kahchu ayi etye akyehchi oochatihi ihe ehyatatilon, ghanawesittih oohasoohtsoo gha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 34, 'Ahwole atu ya-i-ti-tyes ate atu yachiwotyehlon: kahchu sahta aghatinta, yaotatichne atghe yatatilon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 35, 'Kahchu ayi dzinee, kahkachi aocha, toowehchu yehti, Onka nataghokye taityechi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 36, 'Kahchu yite kitehalon tane natlone, nighatila aoontye sikooh. Kahchu kooyeh testyetlon tachin ela ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 37, 'Kahchu intsi chok niya, kahchu tuyune nachalon tachin ela kooyeghe tiketlalon, kwa hlilon tadesmanooh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 38, 'Ahwole atai haiseuhi, satyi tsiatakyeh: kahchu tsikiyaniha, toowehchu kiyehti Metihi, atu aghaititawoala tghataozitassi? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 39, 'Kahchu niiya, kahchu intsi tsiwoti, toowehchu yehti tu chok, Tyeke tahtsi. Kahchu intsi atyehzut, kahchu ohtye tyesghutl. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 40, 'Kahchu toowela ooli yehti, Yehoogha onenatyetl aoontye? yehoogha atu a kootahti aoontye? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 4, 41, 'Kahchu ohtye onighanintyetl, kahchu toowela klaghatati, Ye teze alontye koole intsi ateate chu tu chok yuzehtso?  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 1, 'KAHCHU nighatiooh taityechi chisinchi tu chok, kootike tsi Gadarene matike. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 2, 'Kwa kootoo tasaya ela ehkye otsi, kwete yatitityesha ehlatye teze natine kwa otsi ayehi yaghatai atu mayis natsutooh, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 3, 'Makwa ooli natine tgha; kahchu atuline yatahnatsut iyu aoontye ihe ayii ihe atu tah taghatsakluh iyu aoontye, atu satsoone klule aghoo ihe taghachakluhassi: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 4, 'Tewotye oontlon tahtsughesklu mihe klule ihe kahchu satsoone klule ihe, kahchu satsoone klule yatayaghechil, kahchu makye chine klule oochu yatayaghechil: kahchu atuline oochu ayilih iyuntyeh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 5, 'Kahchu inkaa hatleketahwoyu dzinetahwoyu, ali khis tah, natine tgha woyu, otyesta, kahchu atakhai tatazo tsye ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 6, 'Ahwole tontye tsi ghotsi Jesus ya-i, otsitehtla yatsi nachustaklyeh, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 7, 'Kahchu ohtye otyesta, kahchu toowela ooli yehti, Tyeka kehe na-kye-o-os-tyi-cha, Jesus, nuni otehchi ooli yatehchi Nagha Tgha chue neli? Natsinioonunisit Nagha Tgha tsi, atu nidisawositi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 8, 'Atai toowela yehtie, Sachighatiya teze zi tsi, nuni atu neyis natsutti aghaghintai. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 9, 'Kahchu tawotya yehti nindizi tyeoolya yehtilon? Kahchu toowela yehti, Legion, oohzi: nitlon ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 10, 'Kahchu yatsinioonunisit atu achu tsutoohigha ayiti tike otsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 11, 'Kahchu ieti alii hwaza khis tah koohkoos natlon eghihta. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 12, 'Kahchu atghe aghaghatai metselihi yatsinioonunisit, toowehchu yehti, ghotsiaghatiha koohkoos natyehti, koohkoos zi toontyelikha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 13, 'Kahchu kwete Jesus ghatyeh yasehla. Kahchu naghaghatai atu mayis natsutti ghaghatestyetl, kahchu koohkoos zi tintyetl: kahchu koohkoos ohtye kyehodihsut ichulti tu chok tghamweh, (oolitah onkye keoneti keoneti;) kootoo chu etye tukooghiwolon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 14, 'Yaghaine koohkoos zaaliine taghatestyetl kooghohwati nito kwa atyih kahchu ayiti tike. Kahchu otsighatestyetl ayi ye keochaahch aoontye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 15, 'Kahchu Jesus kiyunintyetl, kahchu kiya-i ayi tane atsinde metselihi ayehi, kahchu kootoo ayehii ligiona, sata, kahchu natunne tasata, kahchu tyeswe indi ahi: kooh onighanityetl. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 16, 'Kahchu yaghine oohwa-i ine kitati oontye sikooh ayi tane atsinde metselihi ayehi, kahchu koohkoos ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 17, 'Kahchu tyikichi niooghaghananintyetl achutooyigha kootike otsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 18, 'Kootoo tachin ela ehkyiya, yaghi ayehii tane atsinde metselihi yachinioonunisit yehtootyeli gha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 19, 'Atu ghate yasehla Jesus, ahwole toowela ooli yehti, Ootinta niootinoo khadiya, oochu kootinti ooli Ghakaoozutti nakeoahchi, kahchu noohchuya. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 20, 'Kahchu achutyesha, kahchu khootaootyeh Decapolis yechatgheze Jesus oochu nanakeochaahch: koohchu aitye tane khaooghali. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 21, 'Kootoo Jesus natyeski tachin ela ihe taityechi, natlone tane yachitestyetl: kahchu hwa tuchok alii. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 22, 'Nea koohzon ehlaiti yinkhatyesha kakaoozutti tyetachatlihi kwa, Jairus ooyi; kootoo ya-ichi, nakye kuchi naitsut, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 23, 'Kahchu ohtye koonoo yachinioonunisit, toowehchu yehti, Setue tyele satyi koola tehtsutooh: nachinoonunisit, samakataootihi, naghaootai gha; koohzon hanalaite ootesi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 24, 'Kahchu Jesus yehkatich, kahchu natlone tane yakehtestyetl, kahchu kikyeoohsut. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 25, 'Kahchu ehlaiti tsege, yaghi keneti onketi matgha yaskehe matulle natatyehizon, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 26, 'Kahchu natlone ooli yakeoohchi natlon yutane, kahchu yaghatestla ayi oontyei, atuli akehe naghiteyo oontye, atatihe tati, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 27, 'Kootoo Jesus otsi ootitsukoo nooja otsi keistla otsi yatsityesha ootaneghutl ihe, kahchu yakestue katehtich. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 28, 'Atune toowela ehtie, Manatunne zon aghoo katyestich ate, oochu awostyeassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 29, 'Kahchu kwete otsi tul natatyehti sakoon; kahchu atyetastyiht mazi tsi nachagihta avi tatihi tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 30, 'Kahchu Jesus kwete ataotihoo mehnatsutsutti mazi tsi hatsatooh, natunesha tanetiche, kahchu ehti, Mea ali senatunne katehtichlon? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 31, 'Kahchu yaotatichne toowela yehti, Natlone tane ghii tanighatlu, kooh tinti, Mea sekahtihtich? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 32, 'Kahchu klokanatgha yui gha ayi ooli keoachine. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 33, 'Kahchu tsege ooniya kahchu ghati ihe, ataootioo ooli maachahi matsun tsihi, yuhchi yachi yuenenitooh, kahchu yatati aitye hlonchati. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 34, 'Kahchu toowela ooli yehti, Ghutue aha koodinti nanaghinta-iih; taichi tyege inditiah, kechutintih natatihe ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 35, 'Intyizon kwaka ootatyichoo, yachidesha ma kwa otsi yaghi yakaoozutti tyetachatlihi kwa tahkine atine, Netue tehtsut: Yehoo gha mehchintahcha otehchi Metihi? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 36, 'Kwete Jesus sa ootitsukoo, toowela yehti ayi kakaoozutti tane tyetachatlihi kwa, Atu ooniooya, aha koodinti zon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 37, 'Kahchu atuline hateh gha sehla oolino yekehtooyi, Peter zon, kahchu James, John chu mekye James. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 38, 'Kahchu khooniyalon kakaoozutti kwa, kahchu wa-i oontlon tsi oochataahoo, yaghi chu atsukki kahchu ohtye atsukki. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 39, 'Kootoo kwiya toowela ooli yehti, Yehoo gha oontlonchi ootahah aoontye, kahchu ahtsu-ko-oyu? ataze atu tehtsut, ahwole satyih. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 40, 'Hatyeh oontlonchi kiyuhaghatakluch. Ahwole ehtyezon aitye hayateha, otsighadesha yatgha chu you chu ata, kahchu ayi yehkyatechii, koohchu kwinaghacha ata tyelasatyinti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 41, 'Yila inchutlon ata, kahchu toowela yehtilon, Talitha cumi; ayi chati, Ata, niiya, nesii. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 42, 'Kahchu kwete ata niiya, kahchu ghayahl; atai keneti onketi matgha mayaskehe. Ohtye o-ochi khaooghalilon aghawochule kehe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 5, 43, 'Ohtye atuline tataoonti; kahchu atya kehe oolita ooli machuhchut.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 1, 'KAHCHU ieti otsi achudesha, kahchu yuhchidesha ghochati matike; yaotatichine chu yekehdesha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 2, 'Kahchu Menejitti Dzine khoonioonizutooh tye tyetachatlihi kwa taneghaotatyech natlone kootitsakooh khawoalli, ghatih Tyecha otsi niyatilontye? Kahchu ye o-ochi mehoochayu tidi machioo, koole yaghi oochu ekyeotatichi ayilai tila ihe? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 3, 'Atu ayila tachin atali, Mary chue mekye James, Joses chu, Juda dm, Simon chu? kahchu mehtghezze chode mekyechatich? Kalichu atu oochu yatsiintighadesa. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 4, 'Kahchu Jesus toowela yehti, Tane chi otine tune atu mooh oontue iyu aoontye mehe meachatachai, atunezon tatike hwa yule iyu aoontye, kahchu atai hahte menachine, kahchu atai hahte ghochatih makwa. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 5, 'Kahchu ayiti atu kooye keoahchlon mehmawochuli kewotiche, tahkine ghatyeh katehtichlon yatitine, kahchu nayaghihtalon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 6, 'Kahchu kawolilon atu aha yutieh. Ahwole atghe tane tanenatih akehe klodeshalon, taneghaotatyech. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 7, 'Kahchu keneti onketi matgha tyechi yehti, eonetye tsi yeteha onkyetatatye; kahchu yehnatsutti yayila yatanatsutti naghaghatai metselihi; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 8, 'Kahchu aychti atuli yatoolai kyatehchu, tghes zon; atu etsunzis, atu chu otles tyes ali, atu chu sooniya kooghele tasulla: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 9, 'Hoontyegho kyetlhi ahoo zon tatyez; kahchu atu onketi kestue taooya. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 10, 'Kahchu toowela yehti, oolitah nito kwa kwighaachatetah, ayiti ahli achutahaz ti otsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 11, 'Kahchu atu ninaghatile ati, naghatitsukki ata chu, aisai iiti otsi achutaach ate, naghakye waghat otles ihe kooyeh ooghahtichi. Kwa hli anaghaisii, Otehchi aghatane Sodom yu Gomorrha yu oochu awohtyesi ohtye tane tsiochatihi dzine intyizon ayi tike. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 12, 'Kahchu achughatestyetl, kahchu tane taghatih ketselihi ooghachatutii gha, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 13, 'Kahchu natlon metselihi ghaghateha, kahchu kles ihe yakiyehkluk yatitiine, kahchu nayaghinta; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 14, 'Kahchu metihi tyiyi Herod otitsuk mewoyu; (atgheze tike okehe midizi khoochatiihe;) kahchu toowe ehti, John matukeghinkliti atai tustye otsi niiya, kahchu ayiwo mehe ohtye keochatichi eotatya aoontye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 15, 'Achune ghati, Elias atai, kahchu achune ghati atane tai atahwotine, ehlatine eontye atane tai atahwotine. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 16, 'Ootitsukchi Herod, toowe ehti, John ayi matsi hlihyitl ii: tsitike nesta tustyi otsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 17, 'Atai Herod ghochati ochiyateha, John chu niyatinti, kahchu tane kwechayihti tayaghesklu Herodias ihe, mekye Philip tsiyue ihe: atai inkah hlakootsila. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 18, 'Atai John ayehtii Herod, Atu wotezi nai awohi nekye tsiyue. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 19, 'Ayeoo Herodias tike ochehtune yesoohail akhai; ahwole atu hawootli iyu maaoontye: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 20, 'Atai Herod John enejitieh, atayetioo tyeswe ghata, kahchu maghata oochu tane elieh teze, kahchu yama intityesha; kahchu yatitsukchi oontlon kehe keoachlon, kahchu kyenawolesilon ayiteh otitsuk ate. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 21, 'Kootoo sookah nitsutooh dzinee khonioonizutooh Herod niyi dzinee khonioonizutooh hatleke eghohtai gha oola tametihi gha, simakunnis metihi tyiyi chu, kahchu haladi kha kakaoozuni Galilee; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 22, 'Kooh kootoo Herodias matue kwiya tahtitla, kahchu yakeneli Herod chu, ayi yakasatai chu, metihi tyiyi toowe ehti ayi atyedi, Soodinkyet ooli sachinioonunisitassi, atuli necho matuhsesi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 23, 'Kwete oochu ayehti, Atghaze ooli assyesi oochu gho soodinkyet ate, tghatichi ooli assi naslelasi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 24, 'Kahchu hadesha totsi anna. Ye ooduskyet aoontye totsi ehtilon? Tsiyua so toowe ehti, John matukeghinkliti tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 25, 'Iteteh kwete metihi tyiyi tsidesha, kahchu atakyet, kooh koosti atezon sahoalli tsa ihkye John matukeghinkliti tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 26, 'Kahchu ohtye metihi tyiyi atu kenelilon; hoontye ooli oochu ati ihe, kahchu aghatane ihe kookasata, atu yaza ootihyul. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 27, 'Kwete chu metihi tyiyi otsideha teze, kahchu matsi naghahal yehtilon: kahchu otsidesha tane kwechayehti yetsi hlihyitl. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 28, 'Kahchu yetsi nanioo tsakyeh, kahchu atyedi ghioo: ooh ayi atyedi to ghioo. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 29, 'Kootoo yaotatichne oghatitsuk chi, yachihatestyetl kahchu yazeche nighatihtyi, kahchu natine kwati naghanihtyi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 30, 'Kahchu wochichatehane aghanetye intataghati Jesus aliiti otsihatestyetl, atghazi kitatati ooli, keooaachii, kahchu ooli tanegha ootatyechine. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 31, 'Kahchu toowehchu yehti, Tyetahtyel naghai tyinta oolite yaghi kemwehchi, kahchu oontsutli natahyih: kootoo natlon yuhchighatestyetl kahchu yiteghatestyetl, atulita ahwosits kuzza ooli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 32, 'Kahchu naoonai ela tu chok ehkyeatachi ehkyeghaghityetl. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 33, 'Kahchu tane kooya-ih achughatestyetlooh, kahchu natlone atakooyehti, kahchu tane natihti otsi atghe otsi ooghatehsut nito kwa otyiyi aghoo anetye oogha-i, kahchu tane tse nighanintyetl, aghanetye kiyunintyetl. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 34, 'Kahchu Jesus hadesha natlone tane gha-ih, ohtye matsun tatihti kyehe indityesa, uspai etyieh uspai ghaghatane tane atu ayehi: kahchu tye yaghotatich natlon ooli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 35, 'Kootoo ayi dzinelon kwakoole tontyeto kloeh ooli, yaotatichne yachitestyetl, toowe yehtilon eh, Kemwehchi oolilon chodeh, kahchu kwa oonchadeh dzine kloeh ooli: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 36, 'Achuyadeha tike okehe otsighatatyel, kahchu nito kwa ootlonchi, kahchu ataheghatutlihi gha otles tyes: atuli ghatsitsi aghahi ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 37, 'Ateyatetlalon hoole toowehchu yehti ihe, Naghanilon kiyioohtai kooyanahli. Kahchu toowe kiyehti, Yaghe otsi tawotyeli ataghawothhi ila sooniya onkye keoneti ketyi sachunai ehtye otles tyesta, yaghine ghaoohchuti? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 38, 'Toowela ooli nayetilon, Taitya otles tyes ahiwo? oonkawahya. Kahchu ataghowatichi, toowela ghati, Hlahcheti, hluge chu onketi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 39, 'Kooh yehtilon eonetye tsi tahtsi kloke tanepyeds tgha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 40, 'Kahchu ghatye gheskyih inchake, keoneti ketyi tatehtsi inchinatatye, taghane chu hlahcheti ketyi inchinatatye tatehtsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 41, 'Kahchu hlahcheti otles tyes niyatila hluge onketi chu, koohtike ookahtgha yatsi kahchu merci yehti, kahchu otles tyes yataghiyits, kahchu yaotatichne ghila yaniyulel gha; hluge onketi chu anetye tghaestich. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 42, 'Aghanetye eghaghintalon, oochu tataghanastolon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 43, 'Kahchu keneti onketi matgha kloke asklu ghaisis tadesmanoo mechaghintai ihe, hluge ihe chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 44, 'Kahchu yeghaghintaiine otles tyes oolitah hlahcheti keoneti keoneti ketyi sihlon enetyi sihlon tezoo. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 45, 'Ieti tye kwete anetye ihe yutilon yaotatichne tachin elahkyeootyeli kha, kahchu taityechi otsighatuteligha haladih Bethsaida, achutehaton tane. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 46, 'Kahchu kootoo achuteha, atai chu yitaityesha khis tsi yaootootyech. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 47, 'Kahkachi aoocha tsi, tachin ela tatiche tsi tu chok taghalilooh, atane nunkuchi sahti ali. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 48, 'Kahchu yai ohtye keotichoo atowazu; intsita oolieh: oolitah hatlindo aoocha soo tane wohniyalon, tu chok khai niyalon, kahchu yaooyeassilon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 49, 'Kiyainchi tu khai niya, kooh kooghati tane atsinde ali lontye kiyutih, kahchu ohtye oonighanityetllon: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 50, 'Aghanetye kiyai, kahchu atu oochu indighatyesalon. Kwete inchi ooghatatyech, kahchu toowela yehti, Ohtye soonahtye: suni asli aoontye; atu ooneghahtyel. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 51, 'Kahchu inkhadesha elahkye atine; kahchu intsi adezut: kahchu ohtye khawoghali, kahchu o-ochi khawoghali. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 52, 'Atu ayi indi ghati ihe ayi o-ochi keochaachi kehchi otles tyes: aghatane koodzye natsuttieh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 53, 'Kootoo naghateskyi tsi, koonaghaghintyetl tike Gennesaret, kahchu tghaghiyetl. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 54, 'Tghaghihyetl tsi ela ehkye tsi, kwete atakiyeti, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 55, 'Kahchu kyeton ghatich aonetye ieti otusinkha, kahchu kyekyeyehtich ayi tyelisatyii tatihi, ali iteh oohatitsukooh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 6, 56, 'Kahchu kwiyah assitih nito kwa chisinchi, nito kwa otyiyi koole, tike koole, nikiyityih ayi yatitine atghunni tiche koole, kahchu kichiniooghanunisit kikatutihi gha ghatye makestue maihe aghoo kiyuhchuti gha; yuhchutassihne anetye yaghitalon.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 1, 'KAHCHU anetye machichatyesha Phariseene, tahkine adesklesne chu, ha Jerusalem tsi ghatilhne. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 2, 'Kootoo kiyainchi tahkine yaotatichne aghatsitsoo otlestyes atu ka tila tyeghintyekoo, ayi tsati, kila aghoo atu tyetsaghintyek, tahkine atu tyeswe kooghatilon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 3, 'Aghatane Phariseene, Jewne chu atghe, oontlon chi taghila tyenaghatichoo zon aoontye, atu aghatsits athli, kooghatghoonoo yaootyi hatseto koola otehchi meetiootyeha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 4, 'Kahchu naghatichta ataghe tsi, atu natsun nootootihul ate, atu awoontsitsassi. Kahchu ooli natlon ooli nikitilaine o-otghooni, tsa nootoochatuhul kahchu mihe tu tsato chu, tanihkluchi satsoone tataoochayihi takehchestai chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 5, 'Kahchu Phariseene chu yatiklesne chu, Taotya kiyehti, Yehoo gha mawotintichne atu nakyehchi indi gha tyes aoontye tane haladi otichne tane, ahwole otles tyes eghaghinta atu tahila tyeghaghintyekoo? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 6, 'Ateyatetla, kahchu toowe yehti, Oochu naghai nasetyilon Esaias naghani oontlon nahtahoo, takehnichatinkles akehe, Ayi tane oochu assaghati taaza ihe, ooh koodzye tontye saooh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 7, 'Ghatye ahwole kooyaootastech tanegha ooghatatyechoo tane mihe chioochatihi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 8, 'Tyinta saoo Nagha Tgha otiche, ooahtghoon tane yaghita kehe, nootghochadehulli mehtutsato tsa chu: kahchu ooli natlon ayi etye keoghaach. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 9, 'Kahchu toowe yehti, Oochu Nagha Tgha zake kyenaghali, maghahtai yu aoontye nagha onti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 10, 'Atane Moses kooehtii, Ohtye natgha chu noo chu tao-oncha; kooh hatyehlon ooline tatgha tsi to yu ketseliooh otih ate, chazuhelassi: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 11, 'Ahwole naghai atahti aoontye hoontyeoo ooli tatgha koole to koole, Corban ayi, ayi tsati, kachiahi, yaghi ooli nakeoostich iyu aoontye; kao-ontsutti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 12, 'Kahchu atu otehchi machi nioonunahsit ooli yaaootli tatgha koole to koole; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 13, 'Naghai hahte tsioone Nagha Tgha zake awahtla atuli kyewoti nagha oonti ihe, kanaooii: kahchu ayi etye natlon ooli keoaahch. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 14, 'Kootoo chu aitye tane kawoti tsi, toowola yehti, Anahtye soozahtsoo naghani kahchu atahtsuk: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 15, 'Atuli ayi tane matsun khitsi tatyezut ayi mazi ti achi chahtayuleassi: ahwole yetsi hayatehai ayi ali tane chahte ayihihchi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 16, 'Ooline matsakhe oolitane iiti ootootsukissi, inkai ootootsuk. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 17, 'Kootoo tane oochu tyesha nito kwa, kwenaghacha yaotatichne taoontya yehtilon hleoontye akyehchi oochatihi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 18, 'Kahchu toowe yehti, Kooka naghatsi toontooe aoontye? Atu kyenahtihela, ahtghazai ooli tsehtsi otsi kwetsutti tane, atu chahte ayili eyontye; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 19, 'Atu madzye tsi ihe ahakootyeh, ahwole mapat tsi, kahchu hatsat oochu sookah nininkyieh aitye etsun? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 20, 'Kahchu toowe ehti, ayi tane tsun tsi hadehtsutti, ayila tsahte ayihihchoonte tane. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 21, 'Koodzye ta otsi tane, ine tsi tatyestek ootye indi metselihi, soochachai chu, nakhochityeli chu, tlahchazaghai chu, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 22, 'Atsunne achuneih chu, machachintyi chu, inditselihi chu, oochachiti chu, naoona-i indyetselihi chu, atai metselihi chu, atacho chunehliti chu, achachatachai chu, tsaoochayaghi chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 23, 'Anetye ooli metselihi kwetsut tane tsun tsi, ahwole tane tsahte ayila. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 24, 'Ayiti otsi niiya, kahchu tghanatyesha Tyre yu Sidon yu, kahchu nito kwa ootanaghacha, kahchu koonoo atuline atawo-oti kootilon: ahwole atu nana-i iyu aoontyelon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 25, 'Ehlaiti tsege matue ooli ayehii atsinde metselihi, ootitsuklon, kahchu yuhchideshalon kahchu makye keh nadsutlon: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 26, 'Yaghi tsege Greek tane, Syrophenician ine tsi ihe otsi tazelh; kahchu yachinioonunisit hayatoohai gha atsinde metselihi matue zi ta otsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 27, 'Ahwole Jesus toowe yehti, Inkai hatse tsito tatanooto; atu oochu tsito taghaotlese kooyehwawachutalli, koohchu kli tsi tsatulihi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 28, 'Kahchu ateyatetla kahchu toowela yehti, Ehye, aghaghintaihi: hoontye ooli takyeh yechihtati yue natunahtyeli kli tghaoohtsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 29, 'Kahchu toowe yehti, Tidi sa ihe oodinta; atsinde metselihi natue tsun tsi hadesha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 30, 'Kooh niya tsi takwa, yihtyi atsinde metselihi hadesha tsi, koohchu matue takyeh ustyi keh tyelasatyi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 31, 'Kooh kahchu yitaityesha Tyre yu Sidon yu otsi, otsidesha tu chok tsi Galilee, taghaniya Decapolis. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 32, 'Kahchu kiyananioo hligi majih oontooehu, atu chu oochu ootatichoo; kahchu yachinioonunisit kooya katootihi gha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 33, 'Kootoo otsi yatehti tane natlonti, kahchu yaji ta katihtich, kahchu ghizek, yetsoode chu katehtich; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 34, 'Kahchu yatsi ookahta, otyesta, kahchu toowe yehti, Ephphatha, ayi, Tahaootsitti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 35, 'Itetyeh kwete maji ta hatachil, kahchu matsoode klule tihatuk, kahchu oochu otatich acha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 36, 'Oochu atuline ataawoti yehtilon: ahwole otaihchi atuline satsih ataawotihi, otaihchi ohtye koohootyeh; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 7, 37, 'Kahchu o-ochi kao-oli toowe yehtie, Atghaze ooli tsiwohzon keoahchlon: oochu majioontoowene anayitla oochu ootootsuki gha, kahchu saintakline oochu ootootyechi gha.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 1, 'AYI dzine tane o-ochi natlone, kahchu atuli aghahi kiyutsitsi, Jesus yaotatichne tyechi yehti, kahchu toowe yehti, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 2, 'Satyaghisunni tane natlone, kooh kwa taiti dzinee sihaghahtyih, atuli chu aghahi ghatsitsi ooli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 3, 'Achu kootyehaitye tagha kwa tsi yaghatipatooh, woianh oohatootsitassi, natlone tontye tsi otsighatelyu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 4, 'Kahchu yaotatichne atetyataih, Tyechi otsi gha tayanooto tine tane otlestyes ihe chode kemweh? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 5, 'Kahchu Taitya otles tyes ahi yehtilon? kahchu toowe ghati, Taiuchi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 6, 'Tane tsi tsiwohzon tahtsi tike wozon: ayi ninayatila taiuchi otles tyes, kahchu merci ehti, kahchu yataghiyits, kahchu yaotatichne ghila oochu yaniyuleli; kwa kiyaniyila ine tane gha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 7, 'Kahchu akiyehii tahke hluge yaintsutle: kahchu merci ehtilon, kooh ehtii ine gha nichuleli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 8, 'Kahchu eghaghintalon oochu tataghanastolon: kahchu nachatanatyetl neghatila mechacheliih, taiuchi kloke ghaisis tghatatyesmanooh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 9, 'Kahchu ine eghaghinta, oolita tiko keoneti keoneti ketyi enetyi silon: kahchu achudehalon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 10, 'Kwete ela kyiya yaotatichne chu, kahchu yuhchidesha chisinchi Dalmanutha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 11, 'Kahchu Phariseene yuhchihatestyetla, kwete kichi sooghatayehch, kiyinkhanata yakachi otsi ehtoole taoontya kiyehti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 12, 'Kahchu ohtye hoontatachehlon matsinde otsi, toowe ehtie, Yehoo gha ine chi hlioolate kiyinkhanata ehtoole, kwa hli anaghaisii, atuli ehtoole naghachualassi tine maghestyekne. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 13, 'Kahchu yechudesha, kwete elahkyiya taityechi otsi kahchu yitaityesha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 14, 'Mawotintichne iine kiyutoonaghatihlon otlestyes kitoolai, kahchu atuli aghahii elahkye ehlaiti zon otehchi otles tyes aghahilon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 15, 'Kahchu yechiwoteh. Tyeke khaghahta mehotles chihutli Phariseene, kahchu mehotles chihutli Herod natunne. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 16, 'Kahchu inchioohwatatyech, kooh atuli otles tyes assii ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 17, 'Jesus atawotihchi, toowe ehti, Yehoo gha inchiootahtyech aoontye atu otles tyes ahi? atu ka atawahtihala, atahtsuk koole? kooka naghadzye natatsutooh sahoohwaoontye? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 18, 'Naghatai chu ooli, atu ookanahtghaala? naghaji chu ooli, atu atahtsukila? atu chu kyejetahtila? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 19, 'Kooya tseghila tsi hlahcheti otles tyes hlahcho ootatye keoneti keoneti ketyi enetyi, tanetyi kloke ghaisis tadesmanooh nachatanatyetl nita la? Toowe yehti, Keneti onketi matgha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 20, 'Kahchu taiuchi aline kootghasitich tikooh keoneti keoneti ketyi enetyi, tanetyi kloke ghaisis tadesmanooh nitalala nachatanatyetli? Toowe yehti, Taiuchi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 21, 'Toowehchu yehti, Yehoo gha atu atahtsak aoontye? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 22, 'Kahchu yuhchityesha Bethsaida tsi; kahchu kiyananihtyi teze mataituehi, kahchu kichiniooghanunisit yakatutihi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 23, 'Kwa yila inchut ayi teze mataituehi, kahchu nito kwa tsi achuyetehti; kahchu yatai keghizek tsi, kahchu yakahtehtichoo, taoontya yehti ooli ghiila. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 24, 'Kwa yachi tahyatii, kahchu ehti, Tane ghussi tachin etotyeni. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 25, 'Kahchu yatai katehtich, kahchu yitige ookanahta yehti: kootoo oochu oontyei, kahchu aitye tane oochu ya-iine. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 26, 'Kahchu yakwa tsi yeteha, toowe yehti ihe, Atu otsitaooya nito kwa, atuline chu tataoonti nito kwa. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 27, 'Jesus hadesha, yaotatichne chu nito kwa tsi Caesarea Philippi; otsighatelu, Taootya yaotatichne tsi ehtilon kooh yehtiihe, Mea ali saghatya tane? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 28, 'Kahchu toowela ghati, John tanetukeghinkliti tane ali: ahwole tahkine Elias ghati; kahchu achune atanetaihchi atawotine tane. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 29, 'Kahchu toowe yehti, Ahwole mea ne ahlaoontye? Kahchu Peter ateyatetla kahchu toowela yehti, Nuni ayi Christ. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 30, 'Kwa yatati atuli tsi hohohoontye atuneoo. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 31, 'Kahchu tyi yaotatich, teze chue atghazi ooli kawotoohunne, kahchu yenaooli hoola ale, taneghaotatichi metihi chok yu, adesklesne chu, kahchu tsazughelyu, taiti dzinee kaohtzut ate kahchu tsitike naootezi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 32, 'Kahchu ehtii ayi zake tanenichi. Kahchu Peter nayanaun, kahchu tyi chuhootatyech. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 33, 'Ahwole natanyesha tsi yaotatichne chu kanehtgha, Peter chuatatichlon, toowe ehti ihe, Satuchi otsidiya nuni atsinde metselihi: atu indi natih Nagha Tgha tsi tatyesuttih, yaghi zon ooli tane tsi tatyesuttih. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 34, 'Kootoo tane tsi tyechi ehti yaotatichne chu toowe yehti, Ooline sakehtayeh ati, inkai oochit atu tuti ninayatooalli matsookhatayaghi, kahchu nakehtuyesi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 35, 'Ayih sye nayaghoohtalon kyehghata kehe, tghayatualassi; ayi tayadesooatai kyehghata kehe suni tsi kahchu otich oochu chu, ayi nayahoohtezi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 36, 'Yechiha yatsi ewoyuesiha tane, tike okehe ootanatsut ateoo, tatsinde tghayaghatyeshai ate? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 37, 'Ooli sitah tyesooite taghatai tah? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 8, 38, 'Ooline siooyale tane zake chu chode soochaghachatai chu kyidyetseli chu tanegha; ayilon atane tane chue yaooyaooli, kootoo yuhchininiye ate kochi soochunetyi Matgha keotichne oochune chu.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 1, 'KAHCHU toowe yehti, Kwa hli anaghaisii tahkine chode natehyane atu koozetse nio-olyezi, naooghatyitsi ooli ate Nagha Tgha kyeyi khoonao-ozit ate mehnatsutsutti yu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 2, 'Edzetaiti dzine kloe Jesus Peter chu, James chu, John chu hlyekeghatechlon, kwa hlilon otsighatyesha khis tsi ohtye nataghisatti sahte ooghatyi: kahchu yakaitghaityeh achu meotati. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 3, 'Kahchu makestue mesaniti takulli kye yas etye; atuline chode tike hahtye takulli awolene ooli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 4, 'Kahchu klohnaaghityetl Elias chu Moses chu: kahchu inchiooghatatyech Jesus chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 5, 'Kahchu Peter otyesta, toowehchu yehti Jesus tsi, Metihi, chode itli gha oochu: inkai taodatyedi kwa aootlihi; ehlaiti nuni gha, ehlaiti Moses gha, ehlaiti Elias gha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 6, 'Atu ti kehe atu ataotihi ihe; ohtye oonighanintyetl ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 7, 'Koos inchi ghililon: kahchu sa ooghatitsuklon yatsi, toowe otieh, Tai la se Chue menusli: Soozehtso. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 8, 'Intyizon, aoonetye ookaghanehtha, atuline otehchi kiya-i, Jesus zon kooyehkatech. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 9, 'Khis chi chyesta ghatestyetlyu, yanaootatich atuline tataeonti ooli ohwehtyi, teze Chue niiya ate zon mazetse otsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 10, 'Ayi zake kaghaghatalon, ayi yea tane zetse achatya oontye toon ghlaghatati. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 11, 'Kahchu yehoo gha kiyehti, atesklesne yehoo gha koohatya oontya Elias hatse naoojezi? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 12, 'Kahchu ateyatetlalon, yatatio yu, Kwa hli Elias hatse niya, atghe chu ooli sookah nioonila; kahchu takehnichatinkles akehe teze Chue ihe, natlon ooli kaootoohanu, kahchu menachule. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 13, 'Ahwole suni anaghaisii aoontye, Elias kwa hli nooja, akooghati sikooh kooyekechatihtihch, takehnichatinkles akehe atanewoh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 14, 'Kahchu yaotatichne wohniya tsi, tane natlone yehkyatich chu yailon, adesklesne chu, taoontya tookooyetilon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 15, 'Kwete atghe kiya-ichi, atghe kaooghalilon, kahchu kichiodehsut yilaghinchutlon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 16, 'Kahchu adesklesne tsi, Taoontya nayeti? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 17, 'Ehlaiti chu tane natlodi otsi ateyatetla toowechu yehti, Metihi nananihtyi sachue ayehi atsinde saititakli; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 18, 'Kahchu oolita yihchut assiti koohoontye yayaghinchil: maza tsi oohwoos ooli chu, maghoo natazutsun chu, toontyiyazighai chu: kahchu taoontya kooyesi mawotintichne ghakitoohai gha; kwa hli kooyandatla. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 19, 'Ateyatetlalon ahwole toowe ehti ihe, Naghai naghaje toontooe assine, taisa tsi otsi naghai aoostya aoontye, taisa tsi otsia naghatagha ooslya aoontye? Sananaha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 20, 'Kahchu kiyananiooh: ya-inchi kwete atsinde kooghoontye yayaghinchil; kahchu tike nadsut, kahchu yatatatyech maza tsi wohoos hailyi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 21, 'Taoontya yatgha tsi ehti taisa toh otsi kooh hoontyontya? Toowe yehti tsito ali toh otsi kooh hoontye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 22, 'Oontlon chu tsichataintyi tyenayehtyech ahoo yu, chahteayuliassi: ahwole oolita aotunatlihlon ate, ahoohchunaya, kahchu ahachinootyeh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 23, 'Jesus toowe yehti, Aha koodinti ate, atghazi ooli nakeotoonezi ayi aha kooti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 24, 'Kahchu kwete ayi tsito tatgha tsi otyesta, toowehchu ehti manatu ooli, Naghaghintai, kwa hwe a koosti; oochinootyeh atu a koodestihi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 25, 'Jesus wa-ichi tane yuhchiinhlaghatelyu, atsinde metselihi tsighotye, toowe yehtie, Nuni naza oontooehi najih oontooe ahoo yu atsinde nali, ohtye anesii, yuhchihadiya matsun tsi, atu chu mazi kahchu taooya. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 26, 'Kahchu atsinde otyesta, kwete chu yayaghinchil, kahchu yatsun tsi ghotyesha: kahchu tane zetse etyelon; ayiwola natlone, Tehtsut ghatya aoontye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 27, 'Ahwole Jesus yila inchut, kahchu tahyatihtyih; kahchu tsitike nesta. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 28, 'Kootoo kooyachi nito kwa, yaotatichne sahti wahtila yehtilon, Yehoo gha naghai atu nanitun oontye? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 29, 'Kahchu toowe yehti, Haoontyedi atu ghatyeh ooli ihe ghachatayach, neaghasuchuli zon atu atsutsits ihe chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 30, 'Ieti otsi achughatestyetl, Galilee chu kyechoghatestyetl; koohchu kootilon atuline atawo-otihi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 31, 'Atai yaotatich ihe yaotatichne, toowehchu yehti, Teze Chue tsataghinsut tane tgha, kahchu kizoohelassi; kahchu tsazehai ate, kahchu tsitike nawataizi taiti dzinee. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 32, 'Ahwole atu ooghatitsukoo ayi zake, kahchu taoontya kiyutekhai ooianh kyeghanejit. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 33, 'Kahchu yuhchidesha Capernaum: nito kwa oota ati otye taoontya yehtilon, Yea khama ootahtyechii atghunni otichi? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 34, 'Aghoo atu yachutyehlon: aghatai hahte atghunni otichi hoonchati inchi sooghatatyechlon, mea otehchi chatinchai kha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 35, 'Kachu nesta, keneti onketi matgha tyechi yehti, kahchu toowe yehti, Ooline haladi tooshai ate, ayi zon hli haistlachi ayuhezi, kahchu tane gha aoonetye gha keo-otechassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 36, 'Kahchu tsito niyatihtyi, kahchu tane kuzze nayenihti: kahchu yakoone yinchut tsi toowe yehti, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 37, 'Mea so niyatuhtyeloo ehlaiti ayi etye tsito sindizi kehchi, suni nisatintyi: mea so nisatuhtyeloo, atu suni nisatintyi, ahwole ayi yuhchisatyehai. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 38, 'Kahchu John ateyatetlalon, toowe ehtie, Meti, ghityii ehlaiti atsinde metselihi hayateha nindizi ihe, atu chu naghaketayeh: kahchu nanitun, atu naghaketayeh ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 39, 'Jesus toowe ehti koole, Atu nanaghahun, atuline keoosahch akehe keo-oahchassi sindizi ihe, kwete ketseli hakehe sachuohooteissi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 40, 'Kahchu ayi atu chahte anahilai naghachinati. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 41, 'Mea so chu naghaooalu ehlaiti tsa taismanni tu woton tsindizi ihe, Christ ezon manatunne aghli, kwa hli anaghaisii, atu tayatooalassi machitikechalihi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 42, 'Kahchu ooline chahteayile assine ehlaiti tidi natsutli aha sooti, otehchi ootaizi atunewoh mehnachahtune kazze tsye ma koos echaghesklu ate, tyechunnityeh ate tu chok ticha tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 43, 'Kahchu nila chahtontye ate, hlyenihul: otaihchi oochu nuni gha kweghoya tsaghatati achaghilihi ihe, nila onketi aghoo kochi otsitiya iyu aoontye khoon metselihi tsi, khoon atu nanatsaisti: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 44, 'Nootya atu taikyehti, khoon chu atu nanatsaisti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 45, 'Kahchu nakye chahtontye ate, hlyenihul: otaihchi oochu nuni gha kweghoya tsaghatati achaghilihi ihe, nakye onketi aghoo ghotsinachatutyeissi khoon metselihi tsi, khoon atu nanatsaisti: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 46, 'Noota atu taikyehti, khoon chu atu nanatsaisti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 47, 'Kahchu natai nihe atu oochu ookaitghai ate, hanehchul: otaihchi nawotaizi Nagha Tgha tike tsi oowooeissi natai ehlaiti ate, natai onketi aghoo ate otsinachatuhtyelassi khoon metselihi tsi: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 48, 'Nootya atu taikyehti, khoon chu atu nanatsaisti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 49, 'Aitye tane sootakun natghachulelassi khoon ihe, tsichatullihi assi chu sootakun ihe matghaachulehesi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 9, 50, 'Sootakun oochu: ahwole sootakun natuetah sootakun matghachilihi, tyeha kyehea sootakun matgha awahhliha? Sootakun kyatihch, kahchu oochu eotine klahtyi.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 1, 'KAHCHU iiti otsi niiya, kahchu yuhchiklodesha Judea ti otaihchi Jordan natyechi: kahchu tane yinkhatyesha; kahchu tane ootanaun akehe kooh otye keeoach ahli taneghaotatyechoo. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 2, 'Kahchu Phariseene yechitestyetl kahchu taoontya yehti, Oochu la teze tatsiyue yechanaolohu aotezi? kikaotyehunooh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 3, 'Kahchu ateyatetlalon toowehchu yehtilon Tyeha kehe anaghehtya Moses? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 4, 'Kahchu toowe ghati, Moses hatyeh kha syeklah takehnichatinklessi o-ochatihtyehi adusklesse, kahchu oonchatoohtyellu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 5, 'Kahchu Jesus ateyatetlakahchu toowe yehti, Naghadzye natsut akehe ayi ihe naghatsi achateskleslon tidi sa. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 6, 'Ahwole hatseto otsi tike ooli toh Nagha Tgha teze oola tsege chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 7, 'Ayi otsi teze tatgha echeli to chu kahchu tatsiyue kah awoti; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 8, 'Kahchu kooh chu onkeghatatye kootsun ehlatootyesi: atu otaihchi onkyeghatutyesi ahwole kootsun ehlatootyesi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 9, 'Oo ayi Nagha Tgha tsayaghehtichii, atuline inchake niyulel. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 10, 'Kahchu nito kwa oota yaotatichne taoontya yehti kwaka inhligi tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 11, 'Kahchu toowe yehti, Ooline assine tatsiyue odehtyetine achune chu makahtueh akoochaile ate, soocha keoach. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 12, 'Tsege chu tatsiyue odehtye, kahchu makahtueh achilai ate, soocha keoach. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 13, 'Kahchu kiyananihtyi tsito yechihai, yekatootihi; yaotatichne yachuootatyech ayi naghanihtyisi ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 14, 'Ahwole Jesus wa-ichi, ohtye atu minihtike ooghilelon, kahchu toowe yehti, Ghateh kooyasahlah tsito yechihai sachaghatutyeli, kahchu atu nanahahun: ayi ihe nao-oaizi Nagha Tgha kyeyih tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 15, 'Kwa hli anaghaisii. Ooline atu niyatiooti Nagha Tgha kyeyih yechinekehchi atu Nagha Tgha kahchi koowoyezi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 16, 'Kahchu yakoone ihe niyatintyih, kahchu yakatihtich, kahchu oochu yachi indityesa. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 17, 'Kahchu yitai tyesha atghunni kehchi, ehlaityi yuhchidesha ghatlelhu, kahchu yachinachustatalih, kahchu taoontya yehti toowe, Oochu Tanechiotyihi, tawoshlaitea ahtaze wostazonha? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 18, 'Kahchu Jesus toowe yehti, Yehoo gha oochu indityesa sindilon ha? atuline oochu oontye ehlaiti zon, ayi Tikeaootli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 19, 'Sa tsiwohzon atanati, Atu soocha aoonta, Atu chu tane zaoohel, Atu chu anaooih, Atu chu ketselihoo tsiwotahoontich neotinoo, Atu chu tane nawoah, Ohtye taghooncha natgna chu noo chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 20, 'Kahchu ateyatetlalon toowehchu yehti, Taneghaotatich, atghe tidi kama indityeaiih yeshihto otsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 21, 'Kahchu Jesus yakaihtgha, yuntyeh, kahchu toowe yehti, Ehlaiti ooli nainchi tehtsut: ootinta, anehisi anetye mataghaneli, tyetaisanaine chu ghatanale, kooh ohtye natatootlosi ya tehchi: kahchu yuhchidiya, kahchu ninaootiah ayi sookatiya-i, kahchu sakehtiya. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 22, 'Kahchu atu oochu indityesalon ayi sa tachi, kahchu yitaityeshalon atu keneli ihe: atane ohtye ooli natlon ayehilon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 23, 'Kahchu Jesus klokanatgha, toowehchu yehti yaotatichne, Tewotye atatlate ayine matatintlone kwewootyelassi Nagha Tgha nataghe tsi! ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 24, 'Kahchu yaotatichne yazake kaooghulli. Ahwole Jesus ateyatetla kahchu toowehchu yehti, Tsitohkaine, tahtye indatlaooh ayi kiyasooli mehmehetatintlon kwewootyelu Nagha Tgha mataghe tsi! ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 25, 'Ayi kyeotunni ghatai kwewotyizoo apetsiche kaookoodi, o-ochi matatintlon ehlaiti teze kwewoya Nagha Tgha nataghe tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 26, 'Kahchu o-ochi ghaooghali, toowe hlaghatati ihe, Mea mechua aghatoota? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 27, 'Kahchu Jesus yakaitgha toowe yehti, Tane la atu kookechi nioontsit, Nagha Tgha la atu kooh hoontye: aha atane Nagha Tgha atghezi ooli mahechi nioontsut. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 28, 'Kahchu Peter toowe tyi ehti, Nea anetye kyecho tasityetl, kahchu naghakyehtasityetliih. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 29, 'Kahchu Jesus ateyatetla toowehchu yehti, Kwa hli anaghaisii, atuline ooli kyeghachelihine nito kwa, mekye koole, mehtghizze koole, matgha koole, ma koole, matsiyue koole, maskyege koole, matsatle koole, suni ihe, kahchu otich oochu ihe, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 30, 'Ahwole otsinitooalassi keonetyi ketyi otehche enetyi too, nito kwane, mekye chu, mehtghizze chu, matgha chu, ma chu, maskyege chu, makyeyih chu, kahchu tsookatayaghi chu; kahchu achu tike tsi ghonioonizut ate kwihzon ehchaghatai. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 31, 'Ahwole natlone haladi atine haistlachi awotyeissi; kahchu haistlachi atine haladi awotyeissi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 32, 'Kahchu atghunni aghatii Jerusalem otsi ghatestyetlu; kahchu Jesus yaghatyesha: kahchu kawoghuli; kahchu kiyahsellu oonighanityetlon. Kahchu niyatila keneti onketi matgha kahchu yatatati yesoo yuhniyi ihe, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 33, 'Toowe ehti ihe, Nea Jerusalem otsitatyetl; kahchu tane Chue niyatoohtyelassi taneghaotatich tyiyine, adesklesne chu; inkai mazetse ooli kiyehtlon, kahchu kiyaniyutyelessi achunene; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 34, 'Kahchu kiyachaochesi, kahchu kikatootoozassi, kahchu kikyehoozekassi, kahchu kizoohelassi: taiti dzinee awooche ate tsitike nawootyeissi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 35, 'Kahchu James chu John chu, Zebidee chue, yachidesha toowe yehtie, Taneghaotatyechi, kooh koosti aghaawoti akootiti sikooh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 36, 'Kahchu toowe yehti, Yea sachi nioonunassit naghachanasti? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 37, 'Kahchu toowe kiyehti, Aghaniah sookah ookyetih, ehlaiti mehoonati, hligi oosklaghazihtye, nachatinchai kehe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 38, 'Ahwole Jesus toowe yehtii, Atu atawahti ooli ootahkyeti: atu mihe tuwahto la ayi tsa mehtughastoii? kahchu tunaghakechuhkliti ayi mehtanekhaitsikliti ayi ihe nehsakaichihkliti? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 39, 'Toowe kiyehti, Atu ahandatla. Kahchu Jesus toowe yehti, Kwa hli tuwahtoissi tsaeh ieti otsi tughastode; kahchu ayi mehtukhaitsihkliti mihe tusakechihklitii ihe ayi ihe mihe naghakyechuhklitassi: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 40, 'Ahwole wostyi chisinchi chu tayaghetichu oosklaghazintye atu si senatunne eli kaooali; ahwole kooyachulelassi ayine kooya so-ochesunne, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 41, 'Kahchu kenetyine aghatitsuk chi ohtye atu yatsi kyehanelilon James chu John chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 42, 'Ahwole Jesus tyechi yehtilon toowehchu yehti, Atawahti ayi kechanehtya kehe kikaootsutti ayi achune kooyakeolech; kahchu kootaityiye kooyaghatah. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 43, 'Ahwole naghai atu kooh akehe naghahtyeissi: Ahwole ayi koonoochu sachatoohcha kooti, naghani ayi nagha keo-otichassi: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 44, 'Kahchu ooline assine naghani ihe haladi miindichatoesi o-ochi chatoohchai gha, tane glia keo-otichassi achanetye gha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 45, 'Ayi aghoo teze Chue atu makeochatichi ihe yuhchideya, ahwole tane gha keo-otichassi, kahchu khaooallu yeghataisi natlone yatachi ootane. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 46, 'Kahchu nighanintyetl Jericho: kahchu Jericho otsi hatayaooh yaotatichne chu tane natlone chu, mataituehi Bartimaeus, chue Timaeus, tinkuzze satah tyechihi ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 47, 'Atitsuk chi ayi Jesus Nazareth chihtatyezutti, ohtye tyi otyesta, kahchu toowe yehti, Jesus nai chue David, soonchoonaya. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 48, 'Kahchu natlone yatati atu awotihi gha: hoontye ooli otaihchi ohtye otyesta, David chue, soonchoonaya. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 49, 'Kahchu Jesus hlininiya, kahchu kwehakehe ehti. Kahchu tyechi kiyehti ayi teze mataituehi, toowe kiyehti ihe, Kyeneneli, niiya; tyechi nehti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 50, 'Kahchu ooyadehchus yiatehtakadi, niiya, kahchu Jesus tsidyesha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 51, 'Kahchu Jesus otyesta toowehchu yehti, Ye sachinioonunisita anusleha? Ayi mataituehi teze toowe ehti, Aghaghintai, setai saanaoontlihi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 10, 52, 'Jesus toowe yehti, Taihchi ootinta; na-ihe naghinta. Iitetyeh matai naootli, kahchu Jesus kyehtesha atghunni.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 1, 'Kahchu hwa aghatyi Jerusalem, Bethphage chu Bethany chu chisinchi, khis kuchi Olives aghatyi, yitaityeha onketyene yaotatichne, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 2, 'Kahchu toowe ehti, Taihchi otsitahtyel yito kwa oontlo chi naghanataihchi: kahchu kweghaachatyeh soosooklya aghahtyelassi taghaklu, atu makai achatyi; tahwahut, kahchu yuhchinaghahtyel: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 3, 'Kahchu ooline toowe naghai tyete, Yehoo gha koohghahtya oontye? kooh taghahti, Metihi tiye hehti; kwete cho otsi nayaduesi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 4, 'Kahchu yitaighatestyetl, kahchu soosooklya kiyintyi taghaklu tusklahooka atghunni yaghintyidi; kahchu tahkiyainghut. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 5, 'Kahchu tahkiae iiti naihyani toowe kiyehti, Yehoo gha kooh hahtya oontye taghautti soosooklya? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 6, 'Kooh kiyehti koohotye ayi Jesus akooyehtii: kwa kootayinchut. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 7, 'Kahchu soosooklya Jesus gha naghunihtyi, kahchu kiyeatetahkatti keghihla; kahchu yakaisata. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 8, 'Kahchu natlone kiyeatetahkatti atghunni tsiyaghestla: kahchu achune naghaghihul tatsi tachin tsi, kahchu ghatyeh atghunni ghatunihla. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 9, 'Kahchu ayine haladi atine, kahchu ayine tanekeghatailhne, oghatyesta, toowe ghatieh,Hosanna; Moohchuootaya ayi yuhchideshai yindizi ihe Naghaghatai: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 10, 'Koonoochu moohchuootaya manataghe nagha tgha David, yuhchideshai tindizi ihe Naghaghatai: Hosanna ayi zon o-ochi yataihchi miindiotehah. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 11, 'Kahchu Jesus kwiya Jerusalem, o-ochi tyetachatlihi kwa chu: kahchu kootoo anetye ooli ookaghanehtghachi, kahcu kahkachi aoocha koohnioonizutooh, hadesha Bethany tsi keneti onketi matgha chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 12, 'Kahchu naodike tsi, ooatastyetl Bethany tsi tapat: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 13, 'Kahchu chiche chok chine toontyetsi ya-i maton ooli, yuhchidesha intyizon ooli ion ate: yuhniya tsi aton zon yilah; atu ka chiche nichatilesti kho nioonizut ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 14, 'Kahchu Jesus otyesta toowehchu yehti, Atulire otsitsassi chiche nai ihe too otsi nioonizutti otsi. Kahchu yaotatichne oohatitsalon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 15, 'Kahchu nighanintyetl Jerusalem otsi: kahchu Jesus kwiya tyetachatlihi kwa otyiyi, kahchu hayadesla ayine atagholane kahchu ataghatotane tyetachatlihi kwa otyiyi wota, kahchu yechonayadehklit yakeehtai ayine sooniya klaghayihne, kahchu yestahi chu ayine oyetli tagholane; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 16, 'Kahchu atu hatyeh yasehlai iyu maaoontye ooline yatooai oolita tatawochulihi tyetachatlihi kwa otyiyi oota. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 17, 'Kahchu yaotatich, toowe yehti ihe, Koo atu kooh akehe nichatinklessi la, Sa kwa anetye tane tyetachatlihi kwa wowohyih? Ahwole kooh awahtla anoosine take. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 18, 'Kooh adesklesne chu taneghaotatichne tyiyine metihi chu oohatitsuk, kahchu oonkhaghanatgha tyeha kehe chahteakiyule gha: yeghanejit ihe, aitye tane khaooghulli ihe yachihootehe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 19, 'Kootoo kahkachi ooli tsi, hadesha nitokwa wotyih tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 20, 'Kahchu hatlindo aoocha, taihchi ghataihlu chiche chine maghaye otsi ya-ikoonoo kiya-ih. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 21, 'Ayi Peter kyejetitihyu toowe yehti, Taneghaotatyechi, makintgha ayi chiche chine atu tyeswe adintii kwa sakoon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 22, 'Kahchu Jesus otyesta, toowehchu yehti, Nagha Tgha aha oodinti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 23, 'Atai kwa hli anaghaisi, ooline ti khis atyetane, Achu ninintsit kahchu otsinachatoohtyeli tu chok tsi; kahchu atu tawahkootye ate tadzye ihe, ahwole ihe kootilon ate ayi ooli ehtii sakyehchi niwotsitti; awohiisi atghazi ooli tyekootesi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 24, 'Ayi ihe anaghaisii, Ooli si nioonunisitassi, aghaswehlye ate, ihe kootahti nitaghahali, koohzon naghahaisi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 25, 'Kahchu natahya otye aghaswehli intyizon ooline oolakehe chahte meititaai ate: Nagha Tgha naghai chu ya tehchi ati naghaoochatoohulassi nagha metselihi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 26, 'Ahwole atu ootalai ate, atu naghani chu Nagha Tgha yatehchi ati naghaoodohulassi nagha metselihi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 27, 'Kahchu yuhchighatestyetl Jerusalem tsi: intyizon ghayahlhu tyetachatlihi kwa otyiyi oota, yinkhadesha taneghaotatich metihi tyiyi, kahchu adesklesne, kahchu haladi meindi chatehaneh, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 28, 'Kahchu toowe yehti, Ye makaoonatsut ayiwoh keoonaahch aoontye? kahchu mea nayiwa tidi kakaoodzutti keoonaahchi tidi ooli? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 29, 'Kahchu Jesus ateyatetla toowehchu yehti, Suni chu ehlawotatye taoontya naghosyeassi, kahchu satatahti ate, naghatatuhsi ye kakaoodzutti kooh akehe kewohahch aoontye tidi ooli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 30, 'Matukeghihliti John yataihehi otsi la tatyesut oontye, tane tsi koole? kootatinti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 31, 'Kahchu inchiooghatatyech, toowe ghati ihe, Koohtitye ate Yataihchi otsi; kooh tootyezi, Yehoo gha tawah tahtyaoontye? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 32, 'Ahwole koohtitye ate, Tane tsi; tane eghanejit: ayiwo aitye tane koohkiyehti John, yaghi kwa hli tanetaghatahchne ali. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 11, 33, 'Kahchu ooghatyesta kahehu Jesus tsi toowe kiyehti, Atu koowoti. Kahchu Jesus otatihch toowehchu yehti Suni chu atu naghatatuhsesi naghakaoodzutti ayi ihe keoonaahch tidi ooli.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 1, 'KWA tyi yaotatich yiheaghasule. Ehlaiti yaghi tane oonehye chiche chok chine ochunehyehti, kahchu anetye ootaisuggi oola lon, kahchu hayaghinkyetlon ayeti chiche tu taaoohklitigha, kahchu nayaghintsih khaghatai kwa, kahchu yaniyiooh oonehyene tane, kwa tontyetsidesha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 2, 'Kootoo koonioonizutooh otsiyateha ayi ehlaiti yakeotiche yinkhadoya natlone tezoo, yayual assilon chiche natlone tezoo chiche chine oochunihyehi tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 3, 'Kahchu nighatintyi, kahchu kikutatooz, kahchu tahzoh achukihteha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 4, 'Kahchu yachideha achune woaine; kahchu ine tsihadehyitl, kahchu tsinakoozehai yetsi ihe, kahchu achukideha maooya ooli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 5, 'Kahchu achune otsideha; kahchu ayi hazehai; kahchu achune natlone, tahkine chu kikutatooz, tahkine chu kizehai. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 6, 'Kwaka ehlaiti machue ayehi, o-ochi mandayadetlahoo, ayi chu haistlachi yachiyadeha toowe ehti ihe, Kiya indi nootghahassi sechue. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 7, 'Ahwole ayine oonehyene tane toowe hlaghatati, Tunela katsila kakaoozutassi; kwa hoote zaoogheli, kwa naghani kakao-odzutassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 8, 'Kahchu nighatintyi, kahchu kizehai kahchu khakitihtyi chiche chine ochenihyehti iite otsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 9, 'Yea aaoti ayi kakaoodzutti chiche chine ihe ochanahyehi? yuhchinatlone chahtawoleissi oonehycne tezoo, kahchu achune chiche chine ihe ochanahyehi ghaooalassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 10, 'Koo kahchu atu makeh ootaghatechila tidi aduskles; ayi tsye kiyenali? ayine nito kwa aootline ayi hatse oohniya sookewostidi: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 11, 'Tila Aghakaoodzutti makyeoahchi, kahchu ohtye kawochulih naghataitgha? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 12, 'Kooh chu oonkhaghanatgha kiyuhchutigha, ahwole tane eghauejitlon: aghatane atawo-otihi ihe ako-oyehti ihe ayi meaghasoochali: kahchu kiyechutestyetllon, taichi ghanintyetl yu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 13, 'Kahchu kichiteha tahkine Phariseene chu Herodiana chu, kiyukluhchi gha yazake. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 14, 'Kootoo nighanintyetl tsi, toowe kiyehti, Taneghaotatich atawotihi hlodinti, atu chu ooline inaoohoontyiassi: atu chu kyinditaniha tane oontya kehe, ahwole taneghaodintich Nagha Tgha oontya kehe matlontideh: Tsiwohzon la machulelu mehtikechilehe sooniya Caesar, intooe ate chu? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 15, 'Kaooyeli la, atu kaooyeli koole? ahwole atai atawonatioo meaneahe, toowe yehti, Yehoo gha sakaootahun aoontye? sananahah sooniya satsoone, wosyekhai. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 16, 'Kwa nakiyiooh. Kahchu toowe yehti, Mea achintye sikooh kahchu takehnichatinklesi mindizi? Kahchu toowe kiyehti, Caesar tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 17, 'Kahchu Jesus ateyatetla toowehchu yehti, Caesar ghanahah ayi ooli ayahi Caesar, Nagha Tgha chu ooli ayahi Nagha Tgha. Kwa Kiyaoolih. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 18, 'Kootoo kooyinkhachatestyetl ine Sadducee yaghine nachaghintai oontooe ghatine; kahchu taoontya kiyehti toowe ghati ihe, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 19, 'Taneghaotatyehchi, Moses aghaadusklesiih, Ooline mekye tehtsut, ate, matsiyue chu yechodyesha ate, kahchu tsito atu yechodyesha ate, mekye matsiyue niyatahtyeloo, yaskyege yayanuhi tsito mekye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 20, 'Oowhilihi taiuchine hlyehligi ghili: kwa ayi hatse tsege nitintyi, tehtsutooh atu tsito yechodyesha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 21, 'Kooh chu haladi tachi tsege ninayatihtyi kahchu tehtsut atai chu atu tsito yechodyesha: haladi tachi ayi chu kwaka hlyeih. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 22, 'Kahchu taiuchi aline aghahiii, kahchu atu tsito yechoghatatyel: hli haistlahchi ayi tsege tehtsutii. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 23, 'Hooghaghintyetl tsi, tsitike ghaiskye tsi ooli ate mea soo ate yakahoota tyiooh? taiuchi ghili aghanetye kookahsatalon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 24, 'Kahchu Jesus ateyatetla toowehchu yehti, Atu kha yaghayala, atu itawahtihi ihe, aduskles tyiyi, Tikeaootli koole manatsutti? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 25, 'Kootoo tsitike ghaiskye ate koozetse otsi atu inkah tueakoochila koole atu chu hlakoochilalon; ahwole keotihchi tyiyi yeghinhtyelon yataihchi ati. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 26, 'Ahwole tehtsut ine, tsitike nawokyesi: atu makyeh ootaghatyechtah ooli la Moses adusklese, tyeha yehti kat tsaghehtonti Tikeaootli yechiintechii, Suni Tikeaootli asli aoontye Abraham tgha asli, kahchu Tikeaootli asli aoontye Isaac tgha asli, kahchu Tikeaootli asli aoontye Jacob tgha asli? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 27, 'Oochu natooene atu yeta odeha ahwole yaghitane gha: ayi ihe o-ochi kayaghatsut. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 28, 'Kahchu ehlaiti adesklesi yahchidyesha, kahchu atitsuklon ihe inchiotatyech otye, kahchu atawotihoo tsiwohzon ateyatetlalon, taoontya yehtilon, Tyeya ootaihchi hatse tsiwotsatyehli? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 29, 'Kahchu Jesus toowe hakehe ateyatetla, Hatseto tsiwotsatyehli anetye asikooh titih Nea oozintso, Israel; Naghaghatai Nagha Tgha atane zon Naghaghatai aoontye: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 30, 'Kahchu maoontye Nagha Tgha Naghaghatai atghe nedzye ihe, kahchu atghe matsinde ihe, kahchu atghe nindi ihe, kahchu atghe nanatsutti ihe: ayila hatsetoh tsiwotsatyehli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 31, 'Oo ayi onkye kwa hlye oontye, toowe hakehe, Mataghoonti nehtanoone natsun matintya kehe. Oontooe tsiwotsatyehli ootaihchi miindichatoohai tizon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 32, 'Kahchu adesklesne toowe yehti. Kwa hli Taneghaotatyechi, kooh tintiih hlonchati: ehlaiti zon Tikeaootli ali; atu achune atune zon: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 33, 'Kahchu machutye atghe khadzye ihe, kahchu atghe atsatitsuk ihe, kahchu atghe khatsinde ihe, kahchu atghe mehnatsutsut ihe, kahchu yuatutih yetanoone atwati yakehe, ootaihchi kyeindi ooteha ayi aghoo atghe tsichatihuli chu inghade keochaachi chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 34, 'Jesus wa-inchi ooyu tahwohzon, toowe yehti, Atu tontye tsi anatih Nagha Tgha nataghe otsi. Atu ayi keh taoontya atu nichatitah ooli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 35, 'Kahchu Jesus otyesta toowehchu yehti taneghaotatyechoo sahtgha tyetachatlihi kwa tyiyi oota, Yehoo gha adesklesne kooghatya oontye Christ David machue? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 36, 'Ayi ihe David atane koochati kooehtii Atsinde Oochu ihe, Kakaoodzutti kooyehtii Sakaoodzutti, Nuni sinta noohtichintye atehzonih aiseakooyasle ate tsintanine. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 37, 'David atai hoochati nai Kakaoonadzutti yehti; tyechi otsi gha machue yilontye? Tyetaisanaine kyehanelilon oochu kititsalon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 38, 'Kahchu toowe yehti machiootehe, Matsagha ghahta adesklesne, tane ayine kwaghintyene koo kestue yaintyesne, kahchu kwaghintye kyila chihchiche inchiatahachulihti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 39, 'Kahchu asta otyihti tyetachatlihi kwa, kahchu o-ochi nataghisatooh asta kwehluchayihti: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 40, 'Chahte akiyila ya kwa waatyihi, kahchu tane ghanaahooh oontyes oohatatyech: ayi ti otsinighatooalassi ohtye otaihchi ketselihoo keochaahchi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 41, 'Jesus chu sata sooniya ninchatilesti oghade, kahchu tane ya-ih iotsi sooniya otsiyatelyihoo kweotsi nichatilihi sooniya; natlone chu tatintlone natlon kwechihatehul. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 42, 'Yuhchidesha ehlaiti tsege tiesunni waatyihi ali, kahchu kwehchiyatehyitl o-ochi yaintsutli onketya sooniya satsoone toolya ehlaiti sooniya satsoone enetya eyontyi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 43, 'Kahchu yaotatichne tyechi yehti, toowehchu yehti, Kwa hli anaghaisii, tai tiesunnioo waatyihi naghataihchi ohtye kwechiyatestla, anahtye naghai ooia kwechitala sooniya nichatilesti: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 12, 44, 'Ayi ihe aghanetye kwehchighadestla kootatintlon otsi; ahwole atai yindatli otsi kwehchiyatehyitl anetye ayehesi, anetye ooli yighataisi.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 1, 'HOONTATAHOOH tyetachatlihi kwa otyiyi tih otsi, ehlaiti yaotatichi toowe yehti, Taneghaotintichi, nea ti tsye naih atotye, kahchu nito kwa atotye chode ooli! ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 2, 'Kahchu Jesus otyesta, toowehchu yehti, Onaila tidih kwa tyiyi tonli? atu ehlaiti woo meachu chatuyesi tsye tasaoo nachatihulassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 3, 'Kahchu sata klataihchi khis ke Olives ooghade tyetachatlihi kwa tyiyi, Peter chu James chu John chu Andrew chu taoontya kiyehtilon sahti aghati zahtgha, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 4, 'Aghatatinti, taisatsi ooli khoonioozit aoontye? kahchu ate taootyaoontye kootoo anetye ooli ooghade nininkye ate? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 5, 'Kwa Jesus atoyatetla toowehchu tyi ehti, Tyeke atuline naghanooah: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 6, 'Natlone chu yuhchighatutyelassi sindizi kehchi, toowe ghatuti ihe, Suni Christ; natlone chu ghanooahassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 7, 'Kahchu atahtsuk ate natsapahi kahchu natsapahi eoyu ate, atu nagha khazatawahtyel: ayi etye ooli kehchi nio-otsitassi; ahwole halohchi atuka koohnao-ozitassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 8, 'Ayi ihe ehlaitidi tane ghataghitodeh kiyinkha ghatapah achu tanane, kahchu tane tike inchi niihach: kahchu eonetye tsi tike ootooloone tsi, kahchu wo-olyesi to khasihai tsookachatayahi chu: ayila tatyeski ochati kyeatsunatsitti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 9, 'Awole achukhahahta naghai: naghaghatoochitassi tsiwotsatyelchi; kahchu tyetachatlihi kwa oota naghatghatsutyesassi: kahchu nanaghachulelassi haladi tsiwotyihi metihi o-ochi metihi tyiyi chu suni ihe, ayi ihe kooyeh ooghahtichoo. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 10, 'Kahchu otich oochu ihe hatse kooyehoochutichassi tike okehe atghe tanane tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 11, 'Ahwole otsinaghachataistle ate, kahchu naghachataitsut ate, atu ahunataihchi kindiwahtsit atawahtyakehe sootasun koole ataghahkyakehe: ahwole ooli si naghachualassi ayi sakehchiaghali ayi otahtich: atu naghani otahtyech ahwole Atsinde Oochu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 12, 'Mekye taza ihe yatutsitassi azeche tsi mekye, kahchu atgha khachue; kahchu tsihone koonahchine niwotyelassi, kahchu nakiyuteissi tsazuheli gha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 13, 'Kahchu naghai tane naghachatuh Ikeassi sindizi ihe: ahwole ayi ayuhi haistlahchi otsi, ayi nachaoohtaisi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 14, 'Ahwole wa-itah ayi metselihi chahtehnitsutsiti tsi kamaotatyehchi Daniel atanataihchi atawatihi nachaghintsitti ayiti o-otooassi lon, (ayi aghasule inkai ootootsukki,) inkai ayine Judaea aline khis tsi ghatoowhezi: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 15, 'Kahchu ayi tahtaghatsi nito kwa atu noocha nito kwa otsi, koole atu ayite kwewoya oolitah nitooaluh makwa otsi: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 16, 'Kahchu yaghi achunihyehti oota ati atu tahnatoocha yehatyetakhati niyatooallu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 17, 'Ahwole atu oochu awohtyeissi ayine koozita tsito tehtsine, yaghine chu tsito yehtochne ayi dzinee ! ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 18, 'Kahchu aghasuahlih nahuthataklihi atu yaske ooli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 19, 'Ayi ihe dzinee oolezi tsookachatayahi, ayi etye natooehi zon ooliih toh otsi hatseto tike ooli toh otsi Nagha Tgha ayilaii, kwa hlilon too otsi, atu koole o-otoowesi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 20, 'Kahchu atu Tikeaootli dzinee nakhasse oolai ate, atuline ootaizilon: ahwole matghachihchine tsi, yatgha-ihchilon, natya oolalon ayi dzenee. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 21, 'Kahchu ooline toowe naghahtye ate, Nea, taila Christ; koole nea, yaghitih atih; atu a Kootaghahti: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 22, 'Ayi ihe atu tyeswe Christ kahchu atu tyeswe ghaghatane niwootyelassi, kooh chu kiyuesi ehtole kahchu kawochuli, aghanooahi gha, awowootli iyu aoontye ate, matghachihchine. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 23, 'Hoontyeoo khama-inditahsit naghani: nea, naghatasiih atghazi ooli ootagha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 24, 'Ahwole ayi dzinee, kaohtzut ate ayila tsookaehatayahi, sa ihewohelassi hatleke iza chu atu kaooalassi maootaghe, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 25, 'Kahchu yataihchi sun ooli nakyelassi, menatsutsutti yataihchi ta ooli yatooloonassi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 26, 'Kwa ayiti kiyueissi teze Chue yuhchidesha khoos tgha o-ochi mehnatsutsutti chu tsatinchai chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 27, 'Kwa iiti otsiyateha yakeotihehi tyiyi, kwa chu nachaghanoolelassi yatghachihchine tyeotatyechi otsi ninchi, o-ochi tike wolonhchi otsi kwa hlilon o-ochi yataihchi lonhchi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 28, 'Kwa hoote ookaatawahti mihe achati chiche chine tsi; kootoo kwaka matatse natsutletonh, kahchu ato nehyehta, atawahtihoo hwaza atoleh ooli: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 29, 'Kooh otye naghani chu, wa-ichi tidi ooli koohnininkye ate, atawahti kwa hwa ooli, tusklah koole. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 30, 'Kwa hli anaghaisii, taine yahlaniyune tanane atu koolonh oolesi, aise atghe ooli tidi achahi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 31, 'Yataihchi chu tike chu o-otooesi; ahwole sezake atu woloh oolesi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 32, 'Ahwole ayi dzinee kahchu ayi sakehchiahali atuline atawoti, ama, atu keotihchne tyiyi yatehchi atine aghoone khachue aghoo, khatgha zon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 33, 'Tyeke naghai, ootanahi kahchu aghasuahli: ayi ihe atu atawahti kooh nawizut ate. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 34, 'Tezoo Chue ali ihe tezoo yetye tontyetsi tatyeh ihe, tanito kwa kyechotyesha, kahchu yatsiwosta yakeotichne, kahchu anetye tezoo keotihch akehe, kahchu ayehtii tusklah khaghatai ootanoo gha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 35, 'Ayi ihe ootanahi: atu atawahtihi aoontye kootoo nito kwa khaghatai naoochati, kahkachi koole, hatleke tatichi koole, tihchok otyesta zahtgha koole, hatlindo koole: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 36, 'Intyizon nooja ate, atu nahoohtyeloo satyechu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 13, 37, 'Kahchu ayi anaghaisii anetye kooyesi, Oonahi.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 1, 'Onkyeti dzinee oolesta ooli kwehlachayihi passover achati, kahchu otles atu chehyutli: kahchu taneghaotatyechi tyiyine adusklesne chu oonkhaghanatgha oolakehe naoonai nighatuhtyeli gha, kahchu kizuhelyu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 2, 'Ahwole toowe ghati, Atu kwehlachayihi dzinee eli, atu tane inchiniootyelu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 3, 'Kahchu ali Bethany tih ma kwa oota Simon chusache ayahi, intyizon sata atsitsoo yuhchidesha tsege ayahi khluk tsye khaisis spikenard otsi o-ochi matahi natlon; kwa yataghataghiooh tsye khaisis yitii, kahchu yatsi kachi nayadinklit. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 4, 'Kahchu tahkine atu keghaneli kooyindi ihe, kahchu toowe ghati, Yehoo gha tidi ghatsatyestka tidi khluk? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 5, 'Ayi ihe ataghachulekhai ootaihchi tghakooh keoneti ketyi sooniya satsoone ihe, kahchu tyetaisanaini ghachulelakhai Kwa atu tyeswa akiyehti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 6, 'Kahchu Jesus toowe yehti, Atu machuwahti; yehoo gha machisootahtyihch? ootaihchi oochu saatyiinh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 7, 'Ayi ihe inkaa eahline tyita-isanaini, kahchueoonetye akootahti o-ochi akooyaghaklehesi: ahwole suni atu inkaa naghaasli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 8, 'Koo hatiih machitelonh otsi: ootagha yuhchidesha yuhthlukke gha oochu nisachutyel gha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 9, 'Kwa hli anaghaisii, ooli tsi otsi tidi otich oochu moohwochatih ate tike okehe, tidi chu atii moohwochutyehesi menachutihi gha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 10, 'Kwa Judas Iscariot, ehlaiti keneti onketi matgha ihe, yinkhadesha taneghaotatyech tyiyi metihe, ooli oochadehyitli kyehodewoosh, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 11, 'Oohaditsuk chi, ohtye kyehanelilon, kahchu ootagha tsi akiyehtilon sooniya yaooleli. Oonkhanatghalon tyehakehe sookah nio-otsitigha chahte autigha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 12, 'Kahchu hatseto dzinee otles atu chihyutli, kwa ooghazehai passover, yaotatichne toowe yehti, Tyecha koodinti nataghasootaoozani ate oonsitsi passover? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 13, 'Kwa onkye tane yaotatichne yitai tyeha, toowehchu yehti, otsitahtyel nitc kwa otyiyi tsi, kwa matiti tagahazasi ehlaiti teze yaalu ehlaiti mehtukachatayehi taismanooh tu ihe: makehtahaz. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 14, 'Kahchu kwiyesitti, toowe ahti nito kwa kakaoodzutti, Wondi achune kwa ayiti o-ositsti passover mawotastihchne chu? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 15, 'Kahchu wahih naghotyesi ooncha tyinta ooli chelohchi soowachisunooh: Naghani gha iehti soowatahsun. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 16, 'Kahchu yaotatichne yitaighatestyetl yuhchi chu ghatatyetl nito kwa otyiyi tah, kahchu woghiooh akooyehtiii: kahchu yatagha sooghihsun passover. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 17, 'Kahchu kahkachi yuhchinooja keneti onketi matgha chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 18, 'Ghadehtsi zahtgha kahchu eghinta, Jesus toowe ehti, Kwa hli anaghaisii, ehlaiti naghai chodeh sakaehtane chahte asooti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 19, 'Kwa tyi atu keghaneli, toowe chu tyi ghati ehlaityekooh, Suni la? kahchu hligi toowe ehti, Suni la? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 20, 'Kwa ateyatetla toowehchu yehti, Ehlaiti kenetye onketi matgha ihe, yaghi tila ihe setyi tsa ihkye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 21, 'Tane Chue otsidesha, takehnichatinkles akehe otye: ahwole atu oochu oontye yaghi teze tane Chue mihe atahachahi ! otaihchi o-otaizilon yaghi teze ihe atu niniya tah ooli ate. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 22, 'Kahchu aghatsitsoo zahtgha, Jesus otles tyes nidiooh, kahchu merci ehti, kahchu tahke yataghiyits, kahchu yayiooh, toowehchu yehti, Nitahah, mehtah: tila sazi alonte. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 23, 'Kahchu nidiooh mehtusato, kwa kayioo merci, yayiooh: kwa aghanetye ayite otsi tughatolon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 24, 'Ahwole toowe yehtiii, Tila sa tulle alontye aduskles koonde ihe, oontlo chi otsi tyechihkliti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 25, 'Kwa hli anaghaisii, atu otaihchi wostoissi machiche chiche tu chine tsi, kwa hlilon yaghi dzinee kwa kootyinusto Nagha Tgha nataghe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 26, 'Ehlaiti hyin eghachinooh khis Olives tsighatestyetl. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 27, 'Kahchu Jesus toowe yehti, Anahtye naghai atu oochu inditaghaaisi suni ihe too hatleke: takenichatinkles akehe, Ooshalasi aspai ghaghatai haslai ite eonetye tsi natihassi aspai. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 28, 'Ahwole tsitike netai ate, naghaghatuhshezi Galilee tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 29, 'Ahwole Peter toowe ehti, Inkai ahwole aghanetye atu keyaneli ate, hoontye koole suni intue. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 30, 'Kahchu Jesus toowe ehti, Kwa hli anesi, tidi dzinee, tidi hatleke te, atu ka onkye otyesta tyeh tihchok, tghakooh oohchit soota- ghoontyesi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 31, 'Ahwole otaihchi otatich hloduhsi kootieh, Ahwole nakah tanesut ate ooh, atu ihlawotatehoo oohchit noodustyeisi. Kwakooye otye aghatane chu ghatiih. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 32, 'Kwa koohnaghintyetl Gethsemane woyetih: kahchu toowe yehti yaotatichne, Nea aghasushlito sakyeh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 33, 'Kahchu yehtestyetl Peter chu James chu John chu, kahchu o-ochi inditatunne, kahchu matsun tah oonkhail acha; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 34, 'Kahchu toowe yehti, Setsinde o-ochi atu oochu atyetatih azetse tsi: chode ahthli naghai, kachchu ootanahi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 35, 'Oontsutle wotaihai otsidesha-ih, kahchu tike wozohtih nwatsutooh kooyekehchi tyetaooklihassi sye makehchi nio-otsilon, ayi sakehchi ahalai yao-otsitooh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 36, 'Kahchu toowe ehti, Abba, Tyeih, atghazi ooli tahnootsut nuni; tidi mehtutsato saoone naniah: hoontye ooli atu suni koosti, ahwole nuni koodinti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 37, 'Kwa yahchidesha, nayintyi satyi, kwa toowe yehti Peter tsi, Simon sintyi la? atu ooniila ehlaiti meoochanehoo? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 38, 'Oonahi kahchu aghasuhli, atu otsitawohazu inkaoochatauntih. Atsinde kwa hili ootagha, ahwole khazi chintyeh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 39, 'Kwa yitai tyesha, kahchu oghasulih, kahchu kwaka ayi zake ihe ootatich. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 40, 'Kwa oondehsha tsi, yintyi satyi kahchu, (kootai ya-inkhai ihe,) kahchu atu ataooati atyekitooklih akehe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 41, 'Kwa tghakooh yuhchidesha, kahchu toowe yehti, Kwa hwe satyih, kahchu niwotahah mehnatahyihi: kwakoole, meoochanehoo koohnaooizut; nea, tezoo Chue mataghachila taghila tsi metselineh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 42, 'Niahtyel, yitai tawotyeli; nea, yaghi atu oochu asehti kwa hwa atih. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 43, 'Kwa kwete, kwaka ootayehchoo, yuhchidesha Judas, ehlaiti keneti onketi matgha ihe, kahchu yihtestyetlooh tane natlone simakanis pyese chu mekachatayitli chu, taneghaotatyehchi metihi tyiyi ihe, adesklesne chu hoola atityine ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 44, 'Ooh yaghi atu oochu ayehtii yayiooiih mehyachanitsiyi, toowe ehtieh, Ootayatasihchassine wohtsiewohzyesi, ayila ayi; nintahtyeh, kahchu yitai tahtyeh tyekeh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 45, 'Itetyeh nooja ate, tsiwohzon yatsi anaatahlu, toowehchu ehti, Metihi, metihi; kwa yunchighachi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 46, 'Kwa kiyinchut, kahchu nighadintyi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 47, 'Ooh hligi ayiti naghatehyane tapyese natyese ghayaghachut, kahchu nayatehul yakeotihchi taneghaotatyehchi metihi tyiyi, kahchu yatsakhe tyeghihyitl. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 48, 'Kwa Jesus ateyatetla, toowehchu yehti, Ihla unoosi khataachila pyese intyesi yu mekachatayitli yu tala nisataghahtyelu? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 49, 'Naghaikyastaichii dzinee eonetye tyetachatlihi kwa oota taneghaodintihchoo, atu chu nisatahtyiih: ahwole aduskles tyiyi tikewokyeli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 50, 'Kahchu aghanetye kiyechodestyetl, kahchu taghoghadehsut. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 51, 'Kwa ehlaiti uskye yakehtehtla, atetakhatooh chatachi takulli intyedi ati; kwa uskyegoone kiyinchut: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 52, 'Kwa kyechodyesha ayi chatachi takulli, kahchu tghihklah intyedi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 53, 'Kwa Jesus otsighatehtyi o-ochi taneghaotatihchi metihi tyiyi atindi: kwa ayiti atghe yeghati taneghaotatyehchi metihi tyiyi hoolaatitine chu, adusklesne chu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 54, 'Kahchu Peter tontyetsi otsi yakehtehklalon, koole taneghaotatyehchi metihi kwa tsi: kwa yakasatah keotichne, na-itziluh khoon tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 55, 'Kahchu taneghaotatihchne metihi tyiyi atghe chu tsiwatilhne oohatakyet otsi ayi ihe atu oochu akiyuti Jesus kizuheli; ahwole atu oontsutli ohwiooh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 56, 'Ayi ihe natlone ketseli hakehe athlaghatati, ahwole atu hleoontye taghasoocha ootihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 57, 'Ooh tahkine nighintyetl, kahchu atu tyeswe akiyehti, toowe ghati ihe, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 58, 'Tasitsukiih atyakehe, Chahtehaooslyeasi tidi tyetachatlihi kwa tyiyi atsila kila ihe, kahchu taiti dzinee aoocha ate achu nao-osiasi atu kila ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 59, 'Ahwole aghatane chu koosoochawotihi atu hleoontye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 60, 'Kwa o-ochi taneghaotatyechi metihi tyiyi ookaze nazut, Jesus tsi taoontya yehti toowe ehti ihe, Atu atyetunatla la? ye ihea ayi chahte anaghatya oontye? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 61, 'Ahwole atu wotih, atula kehe chu atih. Kahchu o-ochi taneghaotayehchi metihi tyiyi taoontya yehti, kahchu toowe yehti, Nuni la ayi Christ, ma, Chue Moohchuootaya? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 62, 'Kwa Jesus toowe ehti, Suni ayi: kahchu wahyesi tezoo Chue satah noohtichintye mehnatsutsutti, kahchu yahchityesha khoos yataihchi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 63, 'Kahchu taneghaotatyehchi metihi tyiyi tanatunne yaghinchil, kahchu toowe ehti, Ye ootaihchi a soochawochatihi khasootiti aoontye? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 64, 'Ootahtsukiih mehe atachochihliti: naghani ta kootahtya? Kwa aghanetye kooye hlaghatati tsazuheli gha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 65, 'Kwa tahkine tyekookeghizek, kahchu yani aghataghighat, kahchu nakiteghul, kahchu toowe kiyehti ihe, atanataihchi woka atawonati: Kwa keotihchne nakiteghul taghila tyiyi ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 66, 'Kwa Peter yiyue nito kwa otyiyi ti ati, yuniya ehlaiti taneghaotatyehchi metihi tyiyi yawoai tsege: ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 67, 'Kwa ya-i tsi Peter naitziluh, yakaitghah, toowehchu ehti, Kahchu nuni chu mehtintyetliih Jesus Nazareth otsi tatyezutti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 68, 'Ahwole atu a kooti, toowe ehti ihe, Atu atawosti, kahchu atu atasuk atintya kehe. Kwa hadesha tyinta weswatih otsi; kwa tihchok tayidze otyesta. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 69, 'Kwa keotihche tsege kahchu ya-ih, kahchu toowe tyiyehti ayine ieti nehyane, Taila ehlaiti ayine tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 70, 'Kwa kahchu atu koo ooli ehtilon. Kahchu kluhtai ayine ayite nazati, toowehchu ghati Peter, Nuni nooklya ehlaiti aghatane tsi, ayi ihe Galilaean nali, kahchu kooh nakasse atih. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 71, 'Ahwole ketseliooh wotyihi zon ohtye ootatyehch, toowe akehe, Atu atesti tai teze mamawotahtyehchi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 14, 72, 'Kwa onkye tihchok tayidze otyesta. Kwa Peter kyechetehti yaghi sa Jesus ayehtiii, Atu ka ootihoo tihchok tayidze onkye tghakooh oochit sootahoontyezi. Kwa hlilon ayiti indi ootinta, nachaihchahli.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 1, 'Kwa kwete hatlindo aooclia taneghaotatyehchi metihi tyiyino aglianctye ehlakehe tsiwohzon tsiwowatilh hoolya atitine chu adeskilesne chu hlito aonetyo gha tsiwoghatsihi ihe ayi chu, kwa Jesus tahkiyagheskluli, kahchu achukcdehtyi, kwa kikalmihtyj, Pilate. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 2, 'Kahchu Pilato taoontya yehti, Nunila o-ochi koometihi tyiyi nalila Jewne gha? Kahchu ateyatetla toowohcliu yehti, Kooh tintya oontye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 3, 'Kahchu taneghaotatyehchi metihi tyiyine chahte akiyehti ooU nation ihe: ahwole atulakehe atyeta-i. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 4, 'Kwa Pilate kahchu taoontya yehti, toowe ehtie, Atu lakehe atyetanatla la? nea taitya ooli ihe chahte anaghahti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 5, 'Ahwole Jesus zon atu la kehe aye ih kwaka; kwa Pilate kawoolih, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 6, 'Ooh ayi kwelachayihi ehlaiti yezookeh ninkho kvyechehtyesne, ooli assine nioonunisit assine. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 7, 'Ayiti hligi aliih Barabbas ooyeih, ihkahtah chaghcsklu ayi yekatichii kwa akiyila indiootaunne, kootoo tane zehai ihe indiootatunne ayiti. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 8, 'Kwa natlone ohtye oghatyesta tyi yatsi niooghanunisit kooh hakiyulihi gha kooli zon hakooyilai ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 9, 'Ahwole Pilate ateyatetla, toowc ehti ihe, Kooh kootahti la naghachitulisitisi Jewne o-ochi koometihi tyiyi? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 10, 'Atawahtihi ihe taneghaotatyehchi metihi tyiyine yatagliintsutti ihe mihe incho-otsa-i. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 11, 'Ahwole taneghaotatyehchi metihi tyiyine kichinagbayyh tanene, otaihai koochitootsittih Barabbas. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 12, 'Kooh kahehu Pilate ateyatetla toowehchu yehti, Takootahtya oslihasi kooh yachi o-ochi koometihi tyiyi Jewnu woyi? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 13, 'Kahchu toowe hakehe oghatesta, Klaniaitih ninihtyeh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 14, 'Kahchu Pilate toowe ehti, Ye tahtye ketselihoo atyuntye? Kahchu ootailichi o-ochi oghatesta, Klaniaitih ninihtyeh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 15, 'Kwa Pilate tane gha kasootati chatupisha gha, yakahninooh Barabbas assi, kahchu Jesus taghinchut, yakhataghitoos, klaniai nichuhtyelu, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 16, 'Kwa simakanisne otsighatelityi tsiwatyehli kwa, Praetorium wotsatiti; kwa tyechi kiyehti ihlakehe atghe simakanisne. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 17, 'Kwa natunne taghaghintyi aghapai tatulli ihe, kahchu kiyesklu o-ochi metihi tyiyi chahte hoos chok chine ihe, kwa ita tsi gha ghiooh, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 18, 'Kahchu tyi yila ooghatthoon toowe, Yea mehsuchanetyi, o-ochi kookaoonazut Jewne. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 19, 'Kahchu nakidehul yetsi chokhaiye chok ihe, kahchu kikighizek, kwa yatsitaghatsunne ootooghanehzil yatsi nachusghataklihl ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 20, 'Kahchu kiyachatyetl atghe tatulli nighadinchus, kwa yanatunne taghintyetl, kahchu ghooghatehtyi klaniai tih. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 21, 'Kwa kitahnaghutsut ehlaiti Simon Cyrenian ali, ayi kwo noojai, tane natihti otsi Jiadesha, kootgha Alexander chu Rufus chu tahchiyatyilyu klaniai. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 22, 'Kwa nakiyintyi Golgotha tsi, ayi tsati, Atsitsunne ooli te. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 23, 'Kwa kiyayiooh tyewootoo chiche chok tu mathuchunihklito myrrh: ahwole atu niyadiooh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 24, 'Kwa klaniai nikiyinti tsi yanatunne atatghahaistla kikaootehunni ihe, ye anetye teze nitioolola. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 25, 'Kahchu oolitah tghakooh mehooachanehoo awatazoo dzinee ooli klaniadi nikiyinti tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 26, 'Kwa achatyesklesi ayiti otsi chahteachatei takehnichanikuchiih ookeh. O-OCHI KOO METIHI TYIYI JEWNE. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 27, 'Kahchu onkyetine chu klaniadi nighanihtye unoosine; ehlaiti noohtechintye, ooh hligi chu oosklaghazihtye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 28, 'Achudesklessi tyiyi tikenikyih, kooh woti, Kahcliu metseline kah kachanehtyeh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 29, 'Ooh ayine kweghatilhne ayiti oontlochi kiye sootatyihch, tagliatsi ghaghado, toowehchu ghati ihe, Gha, nuni chahta wonatla tyctachatlihi kwa tyiyi, kahchu aoonatla taiti dzinee, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 30, 'Aghatinta, kahchu yulichinootinta klauiai tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 31, 'Aghatane chu o-ochi taneghaotatyech metihi tyiyine ontlonchi akiyehti ihe toowe hlaghatati ihe adesklesne chu, Nayaghehta achune chu; atai koochati atu aghatatah. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 32, 'Oonka Christ o-ochi koometihi tyiyi Israel kwa hoote klaniai tsi noodoojai, wowoti khai kahchu a kootahti. Oo ayi yakah klaniadi yakah atii yataUhlon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 33, 'Kwa inchitakooh klodesha sa kehchi ehalai koonaooizutooh, hatleke aoochaii tike okehe kwa hHlon kalaketi klodesha sa kehchi ehaiai. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 34, 'Kwa kalaketye sa kehchi ahalai klodesha, Jesus otyesta takaseneodi, toowe ehti ihe, Eloi, eloi, lama sabachthani? ayi tsati ihe Saghintai, Saghintai, yehoo gha sechanila aoontye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 35, 'Ooh tahkine ieti nehyane, ooghatitsuk tsi, toowe ghati, Nea, Ehas kawotih. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 36, 'Kahchu ehlaiti otsidehta, kahchu tsifo yeatatih atihih tayatohman sootakan chiche tu ihe, kahchu nayiooh klokhayetgha, kahchu yayiooh tuwoto gha, toowe ehti ihe, Atu kinditaghaha; oonka oohwoti Elias nayaghintyi kha. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 37, 'Kahchu Jesus otyesta ohtye ati, kahchu matsinde kwa yecheli. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 38, 'Kwa ayi hlichatinkatii tyetachatlihi kwa otyiyi intyizon tghahkyehchi wotye cheghinchil yataihchi ctis yiyue otsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 39, 'Kwa kootoo ayi simakunis metihi, ooghade nazutih. wa-i kooakehe otyesta, kahchu yatsinde yechelihooh, toowe ehti, tyewotye tune teze Nagha Tgha Chue ghilelon. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 40, 'Ayiti oohwiliiih tsegene ehu tontyctsi otsi ookhaghanehtgha: atai chu iiti atiih Mary Magdalene, Mary chu ma James ooia etanoohlihi kahchu Joses, Salome chu; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 41, '(Aghatane chu, Galilee atichi, kikehtyeshaii, kahchu ooli kooyaalih ine;) achune chu natlone tsegoo yuhchi kooyehkyatehch ine Jerusalem tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 42, 'Kahkachi aoocha tsi, ayi ihe intyizon dzmee tsi watsehlu ayi dzinee Manejitti dzinee tsi ooh, ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 43, 'Joseph Arimathaea otsi tazehlu, tsatincha tsiwatilh, atune chu ootakah ali Nagha Tgha nataghe, yuhchidesha, kahchu tadzye natsutih seooh Pilate kahkwiya, kahchu Jesus zi ootakyet. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 44, 'Kwa Pilate khawooli kwa tehtsalo ate: kwa simakanis metihi tyechi yehti, tauontya yehti tontyeto ghaite chu tehtsutiih. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 45, 'Kwaatawatih tsi simakanis metihi yatati, tazi ghiooh Joseph. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 46, 'Kwa ataghoola tsatache oochu takulle, kahcliu nooyaghintyi, kaliclm ayi tsatache ii ihe yehtoonehtich, kahchu niyanihtyi natine kwa oota tsyekas tayaghintyi, kahchu tsye otsiyehail toosklahchi natine kwa. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 15, 47, 'Kwa Mary Magdalene kahchu Mary Joses ma oohwa-ih nichanihtyinti.  ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 1, 'Kwa Menejitti Dzinee kawohtzut tsi, Mary Magdalene, kahchu Mary James ma kahchu Salome, ataghaghila yu natunetgha tsehklutti, kwa yuhchighatatyel ate yu ihe kiyuhklukooh. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 2, 'Kwri o-ochi hatse hatlindo ooli hatse dzinee, koohnioonizuiooh natine kwa otsighatestyetl sa niiya tsi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 3, 'Kwa toowe hlaghatati, Mea tsye yughaii aoontye natine kwa tustla otsi? ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 4, 'Kwa koo ookahanehtghachi, oogha-ih tsye achuhchi nichunihailo: o-ochi ghinchai ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 5, 'Kwa kwegliaghintyetlooh native kwa oota, kiya-ih ehlaiti uskye noohtichintye chisinchi sata, tasata natyesooh makestue takulooh: kwa oonighanintyetl. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 6, 'Kwa toowe yehti, Atu oonighahtyel: Minkhanatgha Jesus Nazareth otsi tatyezutti, klaniai nichanihtyiii: tsitike ghinta-ih; atu chode ali; nea nighamhtyintiii. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 7, 'Ahwole ootahtab, yaotatichne tatahtih Peter chu naghaghadesha Galilee tsi: ayiti wahiiissi, naghatatyakehe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 8, 'Kwa kwete khooghatastyetl, kahelm natine kwa otsi tsmtestyetl; yaghatilonlon ihe kahchu khaooghali ihe: kahchu atuline atula kehe akiyeliti; oonighanintyetlon ihe. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 9, 'Kootoo Jesus niiyaii kwete hatse dzine tsiwatselhu, hatse yuhniya Mary Magdalene, ayi taiuchi atsmde metselihi yazi otsi hayateha-ii. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 10, 'Kwa yatatilon ayine yehkyatehchiine, tsukye atu yaghita zahtgha kahchu ghutsakooh ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 11, 'Ooh ahatane, ooghatitsuk tsi ghata, kahchu ya-ilon atu a kooghati. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 12, 'Ayi keh yuhniya achu akelie ouketye agha tane Ihe, ghataihlu zahtgha, achu tike tsi otsighataihlu. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 13, 'Kwa kitati achune: kahchu ama kiyehti ayine. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 14, 'Atyechi yuhniya keneti ehlaiti matgha aline ghiskye eghehta ootye, kwa yachiotatyech majih oontooei kha kahchu yadzye natsutti kha atu a kiyuti ihe ayi yakehtghaii tsitike nesta. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 15, 'Kwa toowe yehti, Otsitahtyel tike okehe matatahti obicn oociiu anetye tane. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 16, 'Ayi a kootyeti kahchu tumakechaghinkliti nachawohtyezi; ahwole yaghi atu a kootyeti cliahta chuleesi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 17, 'Kahchu tidi yachanahai yakeh ootoohsitassi ayine a kootine; Sindizi ihe kehchi ghakitoolelassi atsinde metselihi; oogliatootyehchassi atsoodi koondi ihe; ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 18, 'Nootuze nighatoohtyelassi; oolita tughato ate chu azetse ahi, atu kootoohtihassi; kikatootiassi yatitihne, kwa oochu nakiyaooliteissi. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 19, 'Kwa Naghaghatai sakyedesutooh, yatai otsi nichatihtyi, kahchu sata-ih Nagha Tgha noohtichintye. ');
INSERT INTO `BeaMRK_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (41, 16, 20, 'Ahwole achughatestyetl, tike okehe tane chiwoghatihi ihe, Naghaghatai kahkeooghatihchoo, kahchu sa natsut oola kaootsooli chu intghaninkhi. Amen.    ');
