DROP TABLE IF EXISTS `BeaMRK_books`;
DROP TABLE IF EXISTS `BeaMRK_verses`;
DROP TABLE IF EXISTS `translations`;


            CREATE TABLE IF NOT EXISTS `translations` (
                `translation` VARCHAR(255) PRIMARY KEY,
                `title` VARCHAR(255),
                `license` TEXT
            );
            

            SELECT 'BeaMRK', '# BeaMRK: The Gospel of Mark in Beaver (Danezaa)', 'Public Domain'
            WHERE NOT EXISTS (
                SELECT 1 FROM `translations` WHERE `translation` = 'BeaMRK'
            );
            

            CREATE TABLE `BeaMRK_books` (
                `id` INT AUTO_INCREMENT PRIMARY KEY,
                `name` VARCHAR(255)
            );
            

            CREATE TABLE `BeaMRK_verses` (
                `id` INT AUTO_INCREMENT PRIMARY KEY,
                `book_id` INT,
                `chapter` INT,
                `verse` INT,
                `text` TEXT,
                FOREIGN KEY (book_id) REFERENCES `BeaMRK_books`(id)
            );
            
